(1, 'Analisis Perbandingan Metode Certainty Factor dan Naive Bayes Dalam Diagnosis Penyakit Demam Berdarah Dengue (DBD) Berbasis Android', 'Dengue Hemorrhagic Fever (DHF) is a disease that can make a patient\'s body temperature very high and is generally accompanied by signs of symptoms such as headaches, joint pain, muscles, and bones, and pain in the back of the eye. Dengue Hemorrhagic Fever is caused by dengue virus which spreads through the bite of Aedes aegypti and Aedes albopictus mosquitoes. In this case, an accurate analysis is needed to minimize the diagnosis of errors that makes delays in handling. In this study, an Android-based expert system was made to diagnose DHF that aims as an early prevention. The expert system will provide a choice of dengue symptoms to be selected by the user. The symptoms that have been chosen by the user will be calculated using the Certainty Factor and Naive Bayes methods. With this system, it is hoped that it can help the wider community make a diagnosis of dengue faster. System testing is done using the K-fold cross validation method with a value of k = 3. Based on trials using the K-fold cross validation method, it shows that the Naive Bayes method is able to make a more accurate diagnosis than the Certainty Factor with the test results of 76.5625% and 70, 83333333%.', '9816521 10020214 10271644 9916774 10029313 10693545 10889699 10914961 10043673 9593466 10076819 9733579 9996122 10136960 10065265 9835352 9946976 9891239 10393792 9845436 9774167 9979776 9651276 10032566 9799198 10214980 10059396 10843971 10943639 9796432 10145794 11067326 10024247 10668224 10065584 9843353 11318823 10891091 9924315 10168551 10073817 10049198 10011736 10059609 9693956 10579264 10708932 9520770 9713330 9894876 10653765 9704128 10181990 9894440 10019196 10246182 10215401 10842741 11245064 11303560 10714621 10995077 10815022 10715834 10083971 9794970 9521831 9530810 9763535 10104692 10430390 10369784 10833412 10679724 9648728 10353116 10750070 