(2, 'ANALISIS PERBANDINGAN METODE ENKRIPSI KOMBINASI AES-TURBO CODE TERHADAP TIGA VARIASI KUNCI AES', 'Data communication is a process of sending information from two or more points using a binary code. In data communication sometimes it does not run smoothly, while the obstacle in the process of sending information is data theft until data damage Information is exposed to noise in the process. Therefore we need an application that can provide information security and at the same time avoid damage to data due to noise. One such application is to combine AES cryptographic techniques with a forward error correction technique in the form of Turbo code. This study aims to combine the two techniques and apply to text data and analyze based on the length of the encryption key owned by AES. The results of the analysis show that the AES-turbo cryptographic combination algorithm can work optimally with the percentage of data returning 100% ie at 15 dB SNR. In testing the avalance effect also shows that a 256-bit key length is safer, this is evidenced by the Avalanche Effect trial of 24.77362%. But in testing the data execution time, the longer the key the longer it takes for encryption and decryption. Thus for the selection of 3 key variations of AES that are more efficient and effective, that is by using a 128-bit key.', '9895499 10669326 10768610 10622165 10142187 9695424 9805356 10368871 10784965 10956190 10624115 9761300 10134730 11181403 10985245 10004460 9877746 10326344 10112367 10327576 10143161 10872165 10476671 9805335 10368416 10773573 10746210 10371772 10843349 10928179 9719131 10314505 9816354 11191256 9860179 9786420 9869705 10142189 9695437 9805420 10370559 10827141 11167071 10818028 10685791 10850928 10895380 10275802 10754109 10650241 9891942 10971106 9543129 9825121 10081840 10476684 9805396 10369901 10810622 10109942 9924813 10171041 9745410 9664652 9585719 9956117 10476625 9805112 10362845 10634230 10202510 10922785 10864040 9882867 9961324 10744231 10403