(3, 'Analisis Sentimen dari Media Sosial Menggunakan Metode Information Gain dan Naive Bayes', 'On social media, users can freely express opinions or opinions. Social media can be an alternative solution for conducting sentiment analysis in addition to conventional surveys that require expensive costs and quite a long time. One method that is widely used for sentiment analysis is naive bayes. This method has good accuracy for sentiment classification and is efficient in computing. The analysis process will begin with data collection, then preprocessing, feature selection and classification modeling. Feature selection is done using the information gain method, by calculating the relationship of words to class and classification will be done by naïve Bayes, by calculating the probability of each word against the class. This study aims to determine how the performance of information gain and naïve bayes in sentiment analysis. The measurement results of the method performance include an average accuracy value of 56.6%, a precision of 0.33, and a recall of 0.39.', '10624330 9762380 9685102 10487601 9859994 9846960 9846499 11006831 10112388 11013531 10145900 9898174 10037846 10736220 10203061 10936565 10932935 10133530 11151415 10835315 10817311 10336667 10370435 10824011 10817315 10336686 10370875 10834968 11109221 9685082 10487081 9857381 9833894 9519872 9708851 10653735 10094066 10555461 9808663 10451651 10120036 10814049 10710981 11134550 10360367 10572286 9892785 10601528 10039005 9960115 10331685 10245896 10054316 10818552 10308197 10049336 10793670 9686140 9732210 10770525 11060641 10381435 9536540 9792174 9898481 10430015 10360441 10574191 9902310 10839665 10054718 10820580 10358949 10536916 9715951 10689245 11258839 11159093 10228015 11169796 10927206 10104900 11071487 10381540 9929805 10196018 10760429 10052256 10808270 10441820 9874276 9918365 10920053 11241006 11103909 10597771 10648046 10271596 10306156 9998269 10113600 10262488 10078545 10167365 9821316 1004