(4, 'APLIKASI ANATOMI TUBUH MANUSIA SEBAGAI MEDIA PENGENALAN MENGGUNAKAN TEKNOLOGI VIRTUAL REALITY (Studi kasus ginjal)', 'Virtual reality (VR) is a simulation technology from the real world that is made exactly into virtual form using Android. In virtual reality technology displays 3D objects, sound, and text. Virtual reality is widely used in various fields, one of which is used in education. In the field of education, virtual reality technology is used as a more interesting, creative and innovative learning media. Virtual reality (VR) technology is used in learning the anatomy of the human body. In this application there are features such as zooming and simulating the workings of the kidneys contained in the mechanism of urine formation. User experience indicators with an average value of 81%, MGBL indicators with an average value of 74%, and Evaluation Heuristic indicators with an average value of 83%. Based on the average results of each indicator, it is concluded that the application is easy to use for teaching and learning.', '10435496 11161952 11080695 9700466 10611826 9827604 9685010 10485259 11410787 11442187 11117301 11055360 10355036 10759665 10398556 9805379 10369480 10800163 9848483 9789411 10275294 10751571 10586743 10372406 10873328 9835490 9724434 10731642 10869776 10416970 9897464 9546672 9842832 10151768 10435446 11161719 11074867 9671320 10142989 10871306 10455150 9697743 10022339 10715422 10217832 10073643 9827581 9684879 10481980 11394386 11032176 10275280 10751505 10585187 10333437 9899145 10433276 10832511 10412653 9875871 10178629 5971386 9935170 9708061 9889720 9995575 11218181 11169150 10923991 10600470 10033714 10218547 11323643 11305829 9827600 9684975 10484363 11406311 11330265 10167051 9819738 10036290 10728440 10008480 9978309 10005201 9896286 10028415 9695365 9805051 10361290 10595355 10008142 9969767 9791735 9695445 9805464 10371672 10842832 10854893 10275285 10751535 10585931 10352071 10364966 10809310 10077153 10132559 11127077 10