(5, 'APLIKASI KELUHAN BERBASIS ANDROID DI DINAS PEKERJAAN UMUM KABUPATEN BANGKALAN MENGGUNAKAN METODE RAPID APPLICATION DEVELOPMENT (RAD)', 'Complaints that are ongoing at the Department of Public Works (PU) in Bangkalan Regency are still done manually, namely by visiting the office directly to submit a complaint. So that the agency requires a relatively long time in processing complaints from the public. For this reason, an android-based complaint application was built to facilitate the public in submitting complaints online to the Bangkalan District Public Works Office. This study uses the Rapid Application Development (RAD) method, which is a method of software development with an emphasis on short, short and fast development cycles. Based on 10 evaluator data, the results showed an average value of 85.83%, while the design and display values ​​were 81.78% so that it could be said that the application had achieved its intended purpose.', '9895935 10680320 10368040 9652803 10373501 10851985 11144028 10798365 10632551 10194117 10322274 10010664 9819046 10032840 9806067 11139827 10527523 10059595 10844949 10968181 9752077 10208862 10028802 10876887 10594703 10961957 9596437 9701045 10104921 9654891 9732299 10770991 9900417 10011092 10043518 10463611 9740048 10809720 9696805 10593516 10780185 11302153 10417126 10428762 10329049 10179955 9968264 9997671 9708011 9868288 9888436 10379795 9886183 9977899 10776241 11203506 11095764 9775807 10411437 10680302 10367541 9650315 10361049 10789741 9587946 10011832 10062064 10927220 10104958 11071776 10388803 10111385 10597771 10648074 10271731 10309496 10081840 10956180 10623903 9760239 10129431 11048932 10322893 10026040 10368052 9652858 10373773 10853345 11177984 10968146 9751125 10185040 9909672 9851825 9806114 10778510 10533275 9697723 10021800 10701855 10149999 9734481 9610014 9768932 9848937 9791665 10367597 9650593 10362445 10796699 9761826 10843161 10465915 10142173 9695357 9805015 10360406 10573257 9897634 10332108 106