(6, 'APLIKASI MANAJEMEN PROYEK BERBASIS WEB MENGGUNAKAN METODE AGILE DENGAN FRAMEWORK SCRUM', 'The project is a complex business activity, is not routine, has limited time, budget and resources and has its own specifications for the product to be produced. In working on a project, it is necessary to have a foundation method used in project management. The method must be in accordance with the conditions encountered on a project. The problem that often occurs is that stakeholders tend to use traditional methods, assuming that the project undertaken will be in accordance with the needs that have been defined. Even though, in reality, what is happening on the ground, the possibility of technical changes in the project is very possible. In the traditional method, these changes are less able to be accommodated. Based on these problems, we need a method that is able to cope with changes that occur, so the results or products of a project can meet the wishes of the client. The method that is able to accommodate these changes is the Agile method. In this study, the author will build a project management application with the Agile method using the Scrum Framework. The results showed that the efficiency obtained from usability testing of project management applications has a value of 3.89 (77.8%). Indicates that the user is satisfied with the efficiency of the project management application.', '10960154 10723264 10257057 9879143 9942691 9896098 10684400 10470010 10162651 9926340 11049709 10326786 10123418 10898591 9571201 9965494 10466147 10482485 11396910 11095238 10945045 11126775 10321491 9991005 10322685 10411521 9898007 10037010 10300866 9866094 9877446 9827461 10074922 10140349 10931196 10124845 10934312 10858404 9760875 10132602 11128174 10719092 9845576 9774860 9997165 9695437 9805424 10370630 10828934 10958417 10679856 10040005 9985184 10958330 10677706 10029269 9716740 9911935 10106653 10870124 10425636 10331406 10238886 10960157 10723347 10257470 9881200 9952972 10