(7, 'Aplikasi Survey Online untuk Mendukung Masterplan IT', 'The IT Master Plan is a guide to building information systems and technology in an organization that is in accordance with the goals, vision, and mission of the organization. This research was conducted at the HVA Toeloengredjo hospital, a hospital whose administrative management was using IT. The status of the HVA hospital has been accredited so that the application of the RS SIM has become one of the hospital\'s business management strategies. From the use of IT, it is necessary to support the implementation of the IT masterplan dimension which includes hardware, software, infrastructure, quality of human resources and standard operating procedures applied. This study aims to determine the level of IT implementation in the dimensions of the IT masterplan of RS HVA, therefore survey steps are needed. The interview method or questionnaire paper in conducting the survey is considered to be less effective, because it takes a long time and costs more. Based on these problems, this research was built online survey application to support the IT master plan. On the results of online survey processing analyzed using a Likert scale with a scale of 1 to 5, it was found that 42 respondents of HVA Hospital stated that 84.30% of the IT master plan conditions were ideal supported by good IT conditions of 73.40%, so the results obtained from the comparison both conditions were 87.07%. The level of IT implementation of HVA Hospital was very good.', '9818312 11083453 10104882 10825800 10379101 9708103 10281390 10160390 9786430 9869760 9895778 10285710 9877746 10326344 10112367 10327576 10143161 10872165 10476696 9805470 10371806 10843514 10858310 11322916 11198504 11070749 10041355 10753761 11032176 9848483 9789411 10275291 10751569 10586712 10371580 10852707 9990235 9716911 10501547 9804894 10357394 10497947 9521095 9714949 9902971 10843083 9749602 9685618 9719268 9924570 10169840 9715386 10686415 11244684 10414615 10366