(8, 'Aplikasi Tata Kelola Administrasi Desa Berbasis Hierarchical Model View Controller (HMVC) Bagian Surat Menyurat Desa', 'In managing the administration of village correspondence is still done manually which will slow down the performance of the agency. From the existing problems, the application is needed so that the problem can be resolved. To facilitate the development of correspondence in the administration of correspondence, this application uses the concept of the Hierarchical Model View Controller. The application of HMVC was chosen because it has the advantages to be gained, among others, the development of large software that is easy to do, add or reduce the code and use the modularization technique. This application is a development of the existing Government Administration Application that uses the concept of a Hierarchical Model View Controller, based on PERMENDAGRI No. 47 of 2016. Based on the results of the trial run of the HMVC-based correspondence administration application after testing the application, it was concluded that making this application helps village officials in the process of providing correspondence in an efficient and effective manner to the community. And from the results of testing the questionnaire that has been done that is 82.4% for the application and for the accuracy rate obtained 81.9% so it is quite accurate, so the results of the two questionnaires have a good level of confidence and consistency.', '9680862 9600284 10110900 10320235 9959640 9563941 9929194 10339826 10449411 11231540 10867320 9805458 10371462 10841788 10849666 10304756 10353959 9582396 9873087 9912421 10890340 10930976 10123740 10906596 10783089 10556167 9812195 9998592 9731018 9983323 9740045 10809708 9696499 10591982 10772511 11110322 10629846 10961844 10765492 10077570 10142971 10871202 10452541 9684690 9695991 9587900 10010640 10032310 10183403 10445124 11128753 10331373 10238064 10956060 10620847 9744972 10031195 10702949 9761826 10843161 10465915 10