(9, 'AUGMENTED REALITY SEBAGAI MEDIA PENJUALAN MERCHANDISE GAME JEMIL KINGDOM', 'Augmented reality (AR) is currently widely used in various fields, one of which is in the field of advertising. Augmented Reality (AR) can be used as a sales medium for Merchandise in a game, in this study researchers used Augmented Reality (AR) technology for Merchandise Game Jemil Kingdom in the form of Collectable Cards that can function as markers, Collectable Cards become media for character selection that can used to fight in the Kingdom Games Jemil. This game raises the character of Indonesian snacks, so that it can become a media of knowledge about Indonesian culinary specialties, especially about snacks, the choice of using Augmented Reality (AR) in this study is to provide knowledge about Indonesian culinary specialties, especially market snacks, to a wide audience interactive, narrative and fun, so that players can know a variety of traditional Indonesian snacks and play them interactively. This game also uses Fuzzy logic as a regulatory system in determining Boss enemy behavior with the Shuvit game system where each behavior has advantages and disadvantages of other behaviors in the Kindom Jemil Game. The test results obtained from the output of the behavior is 34.4% Hitting, Kicking by 32.8% and Elbowing by 32.8%.', '9812306 10152014 10050952 10801743 9887966 9986826 9827499 9684489 10472225 11345601 9812561 11172282 10167051 9819738 10036290 10728440 10008490 9978488 10009672 10008043 9967319 9730535 9590290 10060930 10117653 11135237 10412863 10322221 10009316 9684485 10472093 11344941 9796084 10918330 9669880 10107069 10489871 9871344 9903694 10456074 10621195 10527950 10061730 9747051 9692512 9891571 10395470 9887447 9686796 10139321 11243595 11168602 10139999 10922449 10081096 9840585 9749897 9763738 10109721 10946816 9684486 10472129 11345124 9800636 11032176 9848483 9789411 10275289 10751546 10586194 10358592 10395461 9887139 9679108 9947090 10006028 10307561 1042404