(10, 'COMPUTERIZED ADAPTIVE TEST SEBAGAI EVALUASI BELAJAR SISWA', 'Computerized Adaptive Test (CAT) is a form of computer utilization to conduct adaptive tests where questions given to students have been selected from the existing question bank. In adaptive tests, students who have high ability will be given difficult questions. While students who have low ability will be given easy questions. So students who are smart will be more challenged, and students who are less smart will not be depressed.\r\nThe addative test starts from a question with a moderate level of difficulty. if students can answer correctly, then the level of difficulty of the questions will be raised to the level of difficulty. conversely if students answer the questions incorrectly, then the level of difficulty of students will be reduced to the level of difficulty that is easy. This adaptive test can be said to be effective in knowing students\' abilities. this is evidenced by student trials and questionnaire results which show an average rating of 4.1 from the value of the range between 1 to 5 and included in the effective category', '9897519 10719872 11021336 11080872 10091960 10502722 9834360 9718793 9531566 9767321 9774206 10980520 10451179 10108201 10127521 11001204 9693619 9796331 10143307 10872902 10495106 10719926 11021610 11087770 10126472 11179332 11124610 10310661 10501549 9805015 10360367 10572286 9892777 10601272 10037722 9928110 10451195 10108682 10139545 11244716 11196661 11061540 10132940 11136697 10371085 10839901 10840240 11232566 11241070 11105551 9824738 10061291 10853429 11180156 10979005 9973251 9878855 9941265 9860435 9849160 10183403 10445132 11128920 10332216 10259161 10132837 11134082 10358007 10513272 9597722 9707476 10265668 10108691 10139835 11246151 11105500 9824478 10059994 10846942 11017895 10167708 10052716 10029326 9521730 9718130 10309502 10472540 11347174 9851918 9970518 10008957 9990170 10692435 11105526 9824624 10060717 10850558 11108333 10619895 10912091 9