(11, 'DETEKSI LETAK PLAT NOMOR DAN SEGMENTASI KARAKTER PLAT NOMOR  KENDARAAN MENGGUNAKAN METODE HARRIS CORNER', 'Motorized vehicles are a popular means of transportation, especially four-wheeled motorized vehicles. Public awareness and inefficient traffic systems have an impact on travel time in travel, a more severe impact that is the paralysis of traffic in big cities. From these problems, this research detects the number plate location using the Harris Corner method and the number plate character segmentation using Otsu Threshold as an effort to implement an intelligent traffic system. By using test data of 100 motorized vehicle images, the results of the detection of location of number plates using Harris Corner by 90%, while the segmentation of number plate characters using the Otsu Threshold method has an accuracy of 84.14%. Both have high accuracy and can be an option to avoid traffic paralysis, especially at the toll entrance.', '10699461 10919280 10873316 10505400 9901228 10053116 9922337 10158671 9826827 10124437 10924104 10870621 10993827 10393215 9778691 10483567 9839820 9746090 10839937 11231046 10854961 9743652 10827751 10928786 10894040 11023496 9805097 10362489 10625346 10158081 10946763 11169680 10102031 9885271 9973341 9881075 9952372 10158677 9826898 10126199 10968079 9749449 10143090 9699926 9827870 9759930 10014526 10129387 11047799 10317225 9884365 9968816 10000446 9777442 10061662 10855290 11226610 10820671 9572220 9970591 10009306 9998935 11322905 11198282 11069632 10035759 10725786 10332844 10648692 9577366 9996313 11236635 10870784 9822771 10023094 10662442 10311741 10137930 10870748 9822591 10018571 10639835 10137157 10070134 9957167 10332807 10648524 9573068 9974836 10699705 9748640 9732319 10771067 11074162 10449040 11226593 10820570 9571703 9967989 9996300 9673810 9697276 10010712 9819299 10424731 10228248 10125716 10956060 10620921 9745345 10040477 10749374 10922449 10081095 9840496 9749456 9752636 9832210 10098667 9889193 9992941 1115