(12, 'DETEKSI TEKS PADA SCENE TEXT IMAGE MENGGUNAKAN METODE DISCRETE SINE TRANSFORM', 'Text detection is the process of detecting text in an image, followed by surrounding it with rectangular boundary boxes. Text detection can be done using image based techniques or frequency based techniques. Many applications require the detection of text on images ranging from automatic detection of traffic signs that help in the transportation system, helping blind people and others. In this study the data used is a focused Scene Text dataset with images used in size 640 x 480 pixels with the format .jpg. The method used to detect text in images is the Fast Fourier Transform (FFT). The use of the fast fourier transform method aims to minimize the memory requirements of digital images, and to what extent the level of quality degradation of a digital image and file size if subject to a compression process using the FFT method. The average results of this study are precision is 0.44, recall is 0.95 and f1 score is 0.55.', '10206754 11028910 9832161 10098415 9882924 9961606 10368871 10784965 10956175 10623746 9759456 10125504 10950785 9832160 10098403 9882631 9960150 10332560 10267767 10210416 11120467 10289949 9593156 10075272 10142095 11257450 11124385 11090778 10922754 10569454 9878636 10330777 10223203 9877643 9935187 9708468 10290497 10388075 9752972 9840616 10921928 10548875 9775726 9816245 11190716 9846650 10952116 10131626 11103831 9882884 9961392 10363541 10651612 10289425 9579980 9812681 9610379 9770749 9894380 10018888 9847886 9786420 10260327 10415096 11059968 10093636 10154049 10101928 11056612 10009726 10009391 10260322 10414972 11059343 10077949 9761826 10843161 10465915 10142190 9695439 9805421 10370582 10827689 10927205 10104876 11071371 10378629 9857035 9882931 9961650 10370060 10814642 11120464 10289917 9592328 10071120 10121335 10846487 9701302 10111366 10322564 10017826 9854860 11215845 10766826 10474871 9796331 10143261 9700785 9882944 9961692 10371037 10839049