(13, 'DIAGNOSA PENYAKIT BUAH BELIMBING MENGGUNAKAN METODE DECISION TREE C4.5 (Studi Kasus Kebun Belimbing Desa Ngringinrejo Kecamatan Kalitidu Kabupaten Bojonegoro, Jawa Timur)', 'Sweet starfruit (Averhoa Carambola L.) is one\r\nhorticultural potential that is commercial in nature and has the opportunity as a source of income for the community. Many people who want to cultivate star fruit, but star fruit is very vulnerable to plant-disturbing organisms this can make farmers have to think again. The main problem found in star fruit is the attack of fruit fly pests and fruit caterpillars that have almost the same symptoms, if not handled properly will result in undesirable effects such as crop failure so that it can result in reduced star fruit production. In this study using the Decision Tree C4.5 method. Decision Tree C4.5 method is a method used for classification based on tree branches or classification questions and leaves or called class. Accuracy obtained by the star fruit disease diagnosis system by testing the K-Fold Cross Validation to divide the data into 5 parts consisting of 160 training data and 40 testing data obtained the average value of accuracy using the Confusion Matrix method of 99.5%. The results of the calculation of the average F-Measure obtained accuracy and Recall accuracy of fruit flies by 99.62% and 99.62% for caterpillars. The feasibility level of modeling in the star fruit disease diagnosis system obtained an average value of accuracy of 94.57% which involved 6 respondents with 10 questionnaire questions.', '11240552 9920722 10150599 11187540 11015941 9767302 10198866 11150694 10408606 9825109 10081449 10239944 9514826 9683613 9746287 9673465 9805984 10384644 9735836 10584024 9951487 10304418 10897206 11102724 10201217 9990568 10702371 11309956 10846765 9702691 10622935 10886468 10052931 10811639 10135371 9661344 9893575 10621218 10528075 10062347 9762497 9688096 10549966 9843572 11324344 10918711 10062422 10859095 10931141 10905826 11169