(14, 'Diagnosis Penyakit Diabetes dengan Fuzzy Logic Metode Sugeno dan Rekomendasi Pola Makan menggunakan Metode Naive Bayes', 'Diabetes is a disease caused by an increase in blood sugar in the body. Diabetes is a deadly disease whose number of sufferers continues to increase from year to year. This is due to late diagnosis and poor diet. This disease is characterized by a sustained increase in sugar levels especially after eating. So diabetics are highly recommended to adjust their diet according to the number of calories needed. Lack of community knowledge about nutrition becomes difficult for them in determining healthy eating patterns. Sometimes some people go on the wrong diet and result in worsening body health. For this reason, an application that can help diagnose diabetes and provide dietary recommendations is needed. The application was built with the implementation of the fuzzy logic Sugeno method and Naïve Bayes method. Fuzzy logic Sugeno method is used for the diagnosis of diabetes while the Naïve Bayes method is for dietary recommendations. The results of the implementation of the Sugeno fuzzy logic method in diagnosing diabetes, obtained an accuracy value of 76.67%. Thus the accuracy of the conversion results shows that the diagnosis is \"good\". Whereas for dietary recommendations, after 5 times the recommendation test was conducted, the average accuracy of 72% was obtained. Thus the implementation of the naïve bayes method in a dietary recommendation shows that the recommendation results are \"good\".', '9833645 9513605 9677515 10106426 10083125 9891229 10393742 9844250 9768226 9831255 9703260 9844524 10957521 9865827 9876125 10318226 9909373 9844366 9768805 9845817 9776063 10599162 10682843 10054951 11140021 9997080 9751130 9794458 10096446 9513601 9677477 10106235 10078411 9773380 9569551 9957227 10723750 9891240 10393817 9846068 9777316 10058585 10839917 10451662 9680286 10120294 11148446 11133710 9965524 9983981 10076265 10110435 10964667 990156