(15, 'Diagnosis Tuberkulosis Dengan Naive Bayes Dan Menu Diet Bagi Penderitanya Dengan Forward Chaining', 'Tuberculosis is a disease caused by bacteria, it can be transmitted through sputum or air. This disease can attack all ages from various walks of life, but most who suffer from tuberculosis are productive ages between 15 - 55 years. While many people do not know the dangers of tuberculosis, people are reluctant to conduct an examination because it requires a series of laboratory testing. So it is necessary to have an expert system that can help in making an early diagnosis of tuberculosis to reduce the spread and speed up patient care. This tuberculosis disease diagnosis expert system applies the Naïve Bayes algorithm which results in the decision of the consultation answering a number of questions in the form of symptoms experienced, besides that the patient can have a good nutritional status to help the healing process needed a diet menu which is implemented through the Forward Chaining method by utilizing user facts to match the rules in the system. This system has an accuracy rate of 97.2% in diagnoses with Naive Bayes and 93% in dietary recommendations using the forward chaining method.', '11074701 9670495 10071330 9987050 10614390 10884551 10395625 9891229 10393742 9844250 9768226 9831248 9703212 9844284 10951531 9835894 9726450 9569847 9568101 9949994 10078570 10168059 9824775 10854446 9741081 10814880 10607062 10457302 11042622 9900719 10050567 11030439 11308455 11229890 10446426 9654102 10380000 9891227 10393751 9844452 9769234 9856482 9829388 10969695 9536094 9789942 9592947 10074225 10136858 11231270 9688611 10552545 10575342 10477912 10202161 9995294 10132836 11134083 9967391 9993319 10122944 11161712 9987062 10614731 10886255 10438309 10958410 10679691 10039177 9964416 10439149 9807168 9582768 9882406 4873249 5225735 5425662 6425286 9851567 9804818 11133566 10761622 10058220 10831116 10405694 9841085 9752416 9699697 10071141 10121444 11154194 11239