(16, 'EKSTRAKSI FITUR BERBASIS PRINCIPAL COMPONENT ANALYSIS (PCA) DAN MORPHOLOGY OPERATOR UNTUK SEGMENTASI OPTIC DISK PADA CITRA FUNDUS', 'Diabetes is a disease that can attack human organs, especially vision function. Visual dysfunction caused by diabetes is known as Diabetic Retinopathy (DR). The eye is the main organ of visual function, several organs in the eye can be used to analyze diseases including diabetes retinopathy. Optic disc (OD) is the central meeting of the eye nerve. The location of OD in the fundus image is easily observed because OD has a sharper contrast than other features, namely exudate which is a symptom of DR that appears in the form of patches on the eyes. In this study, to determine OD segmentation there are two stages, namely preprocessing and segmentation. In the preprocessing stage, converting an RGB image into a grayscale image using feature extraction based on Principal Component Analysis (PCA), the grayscale PCA value is taken from the eigen vector value based on the largest eigen value. Grayscale PCA image results obtained have better and sharper contrast in presenting optical disk objects. Then the removal of blood vessels using Morphology Operator. At the segmentation stage, the Otsu Thresholding method is used to determine the segmentation threshold value. This method has been tested on a Messidor database consisting of 100 fundus images. With this database, obtained an average accuracy of 99.11%, sensitivity 81.298%, and specificity of 99.412%.', '9833645 9513605 9677515 10106426 10083125 9891227 10393751 9844452 9769234 9856489 9829437 10970942 9542320 9821086 10371573 10461795 9730965 10764318 10852945 9996180 9746636 10842665 11244677 10414495 10362986 10637786 10220290 10586070 9961715 10371682 10842893 10855190 10442970 11074877 9671370 10144236 11028411 10585967 9961202 10358851 10534375 9703230 9844372 10953641 9846446 9779206 9677497 10106333 10080821 9833649 9513771 9678346 10110585 10187161 9920292 10117276 10354416 10