(17, 'ESTIMASI BOBOT KAMBING MENGGUNAKAN BLOB DETECTION', 'Goat is one of the livestock used by humans, one of which is to be used as livestock for meat. Determination of goat prices is generally based on bargaining agreements between sellers and buyers not based on the weight and type of goat. Prices that are agreed upon usually use rough calculations. To measure the weight of farm animals can use conventional scales. Another way you can use the lambourne formula to find out the estimated weight of livestock. Therefore, to make it easier to measure the weight of goats, we need a system that is able to estimate the weight of goats more efficiently. In this study the method used is BLOB (Binary Large Object). The amount of data used is 40 goat data with 3 image capture distances namely 50cm, 70cm and 90cm. The purpose of this study is to provide benefits for both the seller and buyer in determining the weight of the goat used to determine the appropriate price estimate for the goat. Mann Whitney Test results in scenario I, there is a significant difference of 0.012 in the body length test, and the best test results using RMSE (Root Mean Squere Error) is in scenario III of 45.94, because the value is the lowest among the 3 trial scenarios.', '10173691 9811716 10527929 10452252 10135062 11189692 10636070 9821090 10371645 10463691 9740445 10811716 10135071 11189876 10636980 9825626 10456371 9847394 9783954 9833860 10106897 10094985 10578415 10314053 9805102 10362617 10628600 10174349 9828095 10937366 10936940 10153551 9752244 10089442 10049198 10011736 10059612 9694101 10579980 10712498 9609924 9768473 9837415 9734060 9607905 9758385 9975862 9645038 10334679 10320706 9971421 9622840 10223691 9889840 9996176 10061298 10853466 11181085 10983648 9996482 10459631 10110769 10973023 9943337 11435550 10108105 10906446 9610460 9771153 9904461 10069296 9936242 10125408 10392776 11338977 11382501 10735074 9925475 10937338 10936804 10152871 9748831 10072380 9622681 10222897 986991