(18, 'ESTIMASI BOBOT SAPI MENGGUNAKAN METODE ADAPTIVE THRESHOLDING DAN CONNECTED COMPONENT LABELLING', 'The introduction of objects in the image provides a new alternative to find out the weight of cows with Image Processing. Image Processing can help speed up the identification of a cow\'s weight. In image processing, the image obtained will be processed in such a way. This research uses adaptive thresholding and Connected Component Labeling (CCL) methods. The results of image segmentation using thresholding still have noise so a CCL method is needed to remove noise in the image. The dataset used for training was a cow image dataset. Cow dataset has an image of 120 consisting of 3 distances. The study aims to find out how accurate the weight estimation of cattle using the adaptive thresholding method and CCL, both methods are good enough for this research. The results obtained in this study are the results of good image segmentation, can increase the level of accuracy. Measurement of accuracy using the best RMSE in this study is equal to 20,354 at a distance of 150 cm.', '10372684 10847911 11042161 10679665 10039061 9961496 10366129 10716420 10613455 9708009 9888313 9988541 11042243 10289456 9580769 9832372 9708851 10653735 10094066 10555390 9808310 10442744 9897335 10033653 10324619 10069279 9935774 10113780 10334634 9928938 10972916 11042324 10289856 9590746 10063220 10081840 10956180 10623903 9760245 10129459 11049563 10326041 10104824 9760255 10129512 11050906 10332755 10272625 10722490 9862566 9859810 9846027 9823174 10053467 10814326 10202536 9997165 9695356 9805024 10360669 10579835 9930528 10980869 11241160 9935892 10116666 10349067 10104803 10289756 9588240 10019151 9854387 9641606 10317504 9891345 10003715 10956176 10623764 9759546 10125970 10962352 9889999 9996969 10081092 9840397 9748972 9740610 9531566 9767321 9774209 10980534 10451470 10115506 10310165 10098510 10275864 10412890 9877060 10322901 10026261 9897031 10707624 10569481 9878764 9940807 98489