(19, 'IDENTIFIKASI ATRIBUT PEJALAN KAKI BERBASIS FITUR WARNA DAN TEKSTUR MENGGUNAKAN ADAPTIVE BOOSTING', 'The identification of attributes in the pedestrian image still has some fundamental obstacles. The camera\'s viewing angle, lighting, and image diversity are some of the obstacles encountered. A pretty good feature extraction method is needed. Therefore this study uses a combination of color and texture features. Color and texture-based feature extraction methods used are Color Histogram and Multi-Block Local Binary Pattern (MB-LBP) with the learning method used is Adaptive Boosting (Adaboost). The dataset used is the PEdesTrian Attribute (PETA) dataset which has a total data of 19000. This study aims to determine the effect when using only color or texture features with a combination of color and texture features. The result is that a combination of color and texture features can improve accuracy on several attributes. The highest accuracy is obtained by the flip attribute, with an accuracy reaching 76%.', '9823174 10053467 10814326 10202536 9997165 9695351 9804996 10359950 10561857 9840651 11251270 10943962 10188661 9927780 11085745 10116341 10721700 9858597 9839970 10137455 11234259 10935188 10144791 9708432 10289620 9584847 9934321 10218590 10543552 9749118 9683201 10049380 10793891 9691609 10567528 9891945 10971092 9543069 9824821 10074317 9671118 9683820 10064874 9825610 11237528 10235670 10162828 10321341 9987295 9702203 10133836 9987160 10226495 10116959 10350517 10326041 10104755 10289518 9582319 9871155 9902766 10451451 10115053 11080141 10478927 11379109 10650241 10971115 9543174 9825356 10087720 10006181 9920821 10932330 10808924 10067471 9890601 9999983 10937526 10157555 11334752 11361361 10206501 10631974 9800596 9859275 9843366 11319192 10892934 9933536 10214660 11226540 10820309 9570396 9961471 10365531 10701385 10538276 10113356 10256376 9925640 9860447 9849210 9793046 9902829 10061131 11243264 11160320 10098585 9887101 10459411 9719040 10314049