(20, 'IDENTIFIKASI ATRIBUT PEJALAN KAKI BERBASIS IDENTIFIKASI BINER MENGGUNAKAN CONVOLUTIONAL NEURAL NETWORKS (CNN)', 'The ability of computers to identify pedestrian attributes receives great attention in computer vision research because of its high application, one of which is in the field of visual surveillance systems. The methods used by previous researchers still use handmade features (for example color histograms and local binary patterns) which take time because they have to find suitable features from the many features for the case at hand. This research proposes the Convolutional Neural Networks (CNN) method which has the ability to automatically perform feature learning (feature learning). CNN has several hyper-parameters whose values ​​affect classification performance, one of which is the number of convolution layers. In this study, several experimental scenarios were conducted to determine the effect of the number of layers on CNN performance. Several different CNN architectures were trained and tested using a PETA dataset that contained remote footage images. The results of the trials conducted, three CNN models with the number of convolution layers three, five and seven obtained an average f1 score of 56.76%, 59.60%, and 69.00% of the seven attributes identified, respectively. From these results it can be concluded that the more the number of convolution layers used, the better CNN performance.', '9521729 9718131 10309514 10472902 11349001 9897519 10719905 11021500 11084990 10112566 11017902 10167756 9823267 10053936 10816655 10260745 10288216 10721700 9858597 9839970 10137447 11234226 10934469 10141200 9690473 9840651 11251270 10943964 10188671 9927829 11086960 10122418 10873570 9836703 9730504 9980746 10450702 10096352 10221996 9847390 9783941 9833536 11073424 10054731 10820639 10360402 10573231 10719920 11021590 11087261 10123915 11166564 10414720 10368602 10778219 10081099 9840603 9749994 9766072 10158597 10168093 10062324 9761826 10843161 104659