(21, 'Implementasi Arsitektur Model View Controller Pada Sistem Pelayanan Administrasi Kependudukan', 'Population administration services at the Kamal District Office are still using manual methods. This causes the administrative service process in the Kamal Sub-District Office to not be able to run efficiently. Therefore, we need a web-based Population Administration Service System application that is built with the Model View Controller architecture using the Codeigniter Framework. By using the MVC architecture there are several advantages between developing software for easy repair. By using MVC architecture, it can bring changes that make it easier on the population service process in Kamal sub-district, and can also shorten the service process time so that it can reduce the queue buildup while also being able to facilitate admin in the sub-district office in the process of finding population data residing in Kamal sub-district. The results showed that the implementation of MVC in the application of population administration service systems can be easily used and developed again.', '10870661 10994040 10398460 9804909 10357735 10506515 9563941 9929194 10339826 10449411 11231540 10867301 9805369 10369295 10795471 10121832 11156132 10153942 9754193 10099190 10292890 9667691 9661700 9902486 10450041 11234682 10945790 10197799 9973471 10665542 9968445 9998592 9731018 9983324 9739971 10809334 9687130 10538297 10113460 10259025 9991905 10449418 11231566 10867951 9808619 10450545 10092346 10121824 11156106 10153246 9750720 10081840 10956182 10623894 9760192 10129193 11043017 10293308 9669765 9713515 10677066 11067950 9636724 10665587 9968670 9999701 9758762 10122040 11157174 10570601 9884365 9968816 10000438 9777299 10058078 10837363 10778425 11258105 9806262 9578296 9610342 9770577 9890062 9997301 10121846 11156220 10156181 9765389 10155167 11322822 11196218 11059320 9984199 9761826 10843161 10465915 10142173 9695357 9805015 10360406 10573306 9897880 10338238 10675683 