(23, 'IMPLEMENTASI MODIFIKAS KUNCI KRIPTOGRAFI RC6 YANG DIFUNGSIKAN DENGAN BLUM BLUM SHUB PADA DIGITAL IMAGE', 'Image is a media that provides more information than information presented in writing. Therefore an application is needed to secure an image so that the image cannot be seen by unauthorized viewers. One such security application is to use cryptography with the RC6 method. Input is in the form of a digital image, then the image is encrypted and decrypted using the ordinary RC6 algorithm, and then the encryption and decryption process is performed as a comparison by using the RC6 algorithm with a modified key. Modified keys are keys that function with Blum Blum Shub. RC6 algorithm using ordinary keys has good performance, it can be seen from the Avalanche Effect value between 49.9167% and the Avalanche Effect value from the modification of the RC6 key that is 50.0808%. The average encryption-decryption time on RC6 regular keys is 0.8086542 and 0.7348798 seconds and the average encryption-decryption time for modification of RC6 keys is 0.695695 seconds and 0.6764988 seconds. While the average RC6 key PSNR generated is 8.24174 and the RCN key modification PSNR is 8,08961. In general, the Avalanche Effect and the encryption and decryption time on the RC6 key modification are better than the normal RC6 of 0.1641% and encryption-decryption 0.1129592 seconds and 0.058381 seconds. While the PSNR performance is better using an ordinary RC6 key.', '10289705 9586997 9988060 9858371 9838844 9643617 10327576 10143161 10872165 10476635 9805152 10363844 10659242 10476674 9805346 10368701 10780691 10924130 10089519 10051150 10802741 9912910 10111528 10991922 10428472 10321820 9999217 9761826 10843161 10465915 10142185 9695401 9805231 10365751 10706890 10565801 9860354 9848762 9790799 9891596 10004960 9890267 9998313 10895935 9948534 10289642 9585416 9948595 10289947 9593126 10075109 10141281 10563950 9851122 11122405 10299643 10873320 10505499 9903719 10065585 10234051 101