(24, 'IMPLEMENTASI MVC (Model View Controller) PADA APLIKASI LAYANAN ADMINISTRASI DESA DENGAN MEMANFAATKAN API DISDUKCAPIL', 'Village Government (kelurahan) is a government whose duty is to manage and have an obligation in serving the administration of residents at the village level. The administration process of the population in the village of Larangan Dalam, Pamekasan, Madura is now still running manually, such as the process of filing or registering for residents who want to submit a certificate, etc., is still quite difficult, because residents have to go to the village officer\'s house and are still being processed the day after the submission , and also the provision of files that are still ineffective because the file storage system is still fairly traditional by storing files in an ordner. Digital file storage as a copy of the original file is still managed manually which is then increasingly unstructured so it is less efficient. From the above problems, we will implement the Model View Controller (MVC) method for the process of building web-based applications and the Disdukcapil API to make it easier for village officials to obtain data from residents who carry out administrative processes by simply entering the NIK. The expectation of this research is that the web-based application of Village Administration Services can make it easier for village officials in the administrative processing of the villagers to make it more effective and efficient and structured.', '10304776 10354466 9584944 9936759 10230771 10919590 10099812 10699038 10526557 10054774 10820842 10365417 10030320 10698578 10824498 9591341 9706080 10099805 10698951 10526126 10052614 10810042 10095447 11371166 10451678 9680373 9588078 10015051 9751911 10204690 10007926 9805369 10369295 10795528 10123160 11162784 10320235 9959640 9563941 9929194 10339826 10449411 11231540 10867296 9805345 10368625 10778740 10094195 10168070 9824833 10061773 10855837 11240291 10304791 10354841 9586813 9983410 101