(25, 'IMPLEMENTASI SELEKSI FITUR F-SCORE DAN ALGORITMA C4.5 UNTUK DIAGNOSA PENYAKIT DIABETES MELLITUS', 'Based on data from the World Health Organization (WHO), Indonesia is a country that has the fourth highest mortality rate in the world caused by diabetes mellitus [1]. Diabetes mellitus is a disease that has several symptoms that must be watched out for, for example the number of pregnancy, glucose concentration and others. Of the many features that have caused several problems, one of them is the longer process of diagnosis. Selection of features that are less relevant can be used to reduce the process of diagnostic time. The f-score feature selection can be used to reduce symptoms that are less relevant so that the time to diagnose is more effective and the accuracy is better. In addition to the selection of features, the classification of the disease can be done to find out whether the patient is positive for diabetes mellitus or negative for diabetes mellitus. C4.5 algorithm is a machine learning algorithm that can be used for disease classification and can find patterns from data. The purpose of this study is to measure the accuracy value generated from diabetes classification using C4.5 algorithm with feature selection and without feature selection. f-score feature selection method and C4.5 algorithm with 80% of training data resulted in an accuracy value of 72.791% and precision 63, 924% and recall 51.208 with a time of 12.99s', '9610519 9771453 9911929 10106621 10869243 10403634 9830781 9832698 9710462 10661795 10295522 10852707 9990235 9716911 10501555 9805150 10363790 10657870 10320705 9971334 10612147 10092095 10115569 9562341 9921182 10934146 10854349 11203159 10157725 10944978 11125071 11094220 10158716 10168689 10077269 10135527 11201320 10694216 10893076 10999442 9684826 10480649 11387731 10865828 9797990 10184717 10868625 10388105 9753125 9703230 9844372 10953641 9846446 9779206 9833645 9513646 9677713 10107423 10108091 10515475 9999299 10529955 1