(26, 'IMPLEMENTASI TEKNOLOGI AUGMENTED REALITY PADA MUSEUM PENATARAN BLITAR SEBAGAI MEDIA EDUKASI DAN TOUR GUIDE', 'The Penataran Museum was previously named the Blitar Museum. Blitar Museum does not mean the museum in the true sense, but as a salvage hall for ancient objects in Blitar Regency. The development of Information Technology in the world has a very rapid growth rate, resulting in increasingly reduced communities to visit the museum. From these problems, we need a new idea to give another impression in studying the history of the Museum. One of the technologies that is currently increasing is the Augmented Reality technology. Augmented Reality technology is an AR tracking method that uses artificial markers. The Blitar Upgrading Museum Augmented Reality application is very efficient and can help in education and tour guides. Judging from the results of testing the indicators of the indicator Match between the system and the real world91% and Visibility of the system status85%. From the results of an average of 2 tests, namely the Heuristic test with a percentage value of 86% and the User Experiment test, it has a percentage value of 82% which is included in the excellent category.', '10000570 9780537 9748476 9728219 10750582 10784274 11013723 10146845 10703047 10936233 10150036 10392172 10945344 11134205 10749248 10528720 9674966 9843499 9764479 9760012 10407226 9790719 10784198 11011841 10137427 10467604 10784262 11013476 10145622 10672461 10784294 11014286 10149670 10773615 11137926 10089447 10049333 10793637 10075916 9711017 10664568 9583587 9902824 9680601 10375066 9687941 9777246 10056754 10830761 10613448 9707973 9887466 9984302 10936359 9760021 10407391 9794799 10886305 9900376 10010091 10018551 9839444 10134821 10011816 10606060 10842910 10526496 10054469 10819329 10327576 10143161 10872165 10476681 9805379 10369480 10800163 9848483 9789411 10275299 10751606 10587703 10396314 11470947 10870465 10434103 9983129 9735149 10176284 9865909 10267142 1097