(27, 'IMPLEMENTASI TEKNOLOGI VIRTUAL REALITY PADA OBYEK 3D SEBAGAI SARANA PENGENALAN SISTEM PERNAPASAN MANUSIA', 'Virtual Reality is the appearance of three-dimensional images, text and sound that generates a computer, which looks real that is made exactly into a virtual form using Android. Virtual reality is widely used in various fields, one of which is used in education. In the field of virtual technology education Reality is used as a learning media that is more interesting, creative and innovative. The purpose of this research is to develop an application of learning media for human breathing system based on Virtual reality. The purpose of developing this application is easy to use in the teaching and learning process. The learning media still uses pictures and sees the human respiratory system organ that belongs to the MTS MIFTAHUL ULUM school, but the organ in the statue is still incomplete as a mechanism. Types of human respiratory systems that are introduced to students are still general. The application has the features of zooming and simulating the workings of the human respiratory system contained in the mechanism of system formation. In the Virtual reality application the learning media of the human respiratory system is in accordance with the material and teaching and learning process expected by MTS MIFTAHUL ULUM. Based on user experience indicators with an average value of 89%.', '10435496 11161952 11080695 9700466 10611826 9827497 9684472 10471777 11343374 9756820 10717971 9839971 9746834 9687146 9757380 10115130 10300771 9863690 9865430 9874136 10308290 10051593 10804945 10358642 10529166 9677195 10289931 9592741 10073195 10131711 11105970 10217450 11296241 11168815 10922301 10558192 9822326 10011895 10063606 9793932 10083376 9897519 10719896 11021452 11083824 10106717 10871651 9827123 9682595 10424936 9546672 9842832 10151768 10435446 11161719 11074867 9671320 10142989 10871306 10455150 9697743 10022339 10715422 10217832 10073643 9827600 9684975 1