(28, 'KLASIFIKASI BERITA OLAHRAGA BERBAHASA INDONESIA MENGGUNAKAN METODE SUPPORT VECTOR MACHINE', 'News is information based on facts or reports about an event that is, or has already happened. News is published through print, broadcast, internet, and word of mouth. information needs in Indonesia in digital form in the form of text or documents. The classification of news is still done manually so it is prone to errors. The number of news that must be classified based on its category in a short time will make the editor experience difficulties and can cause errors in categorizing because the editor must read one by one news that will be classified. If the classification of news is done automatically it will minimize categorization errors and be more efficient. From the implementation of the system that has been done, the classification of Indonesian sports news can be completed using the Support Vector Machine method with an accuracy rate of 95.72%. Based on the evaluation value of f1-score, Support Vector Machine produces an evaluation value of 95.72%, a Precision value produces an evaluation value of 95.72% and a Recall value produces a value of 95.72%. This shows that in this study the Support Vector Machine model produces an accuracy classification of sports news speak better Indonesian.', '10191969 11049867 10327576 10143161 10872165 10476587 9804925 10358105 10515732 9610009 9768911 9848464 9789296 9576821 9993594 11168670 10921576 10076748 10903690 11159191 11011642 10136447 10052461 10809290 10076605 9758135 10750874 10004485 9878427 9939108 10197095 11178054 10968496 9759887 10404100 10103166 9890928 10001629 10945756 10363235 10800649 9860575 10577560 9528535 9698431 9820394 11135501 10365121 10810099 10096894 10626084 10161781 11355897 10851234 9953360 10704402 10943996 11100579 10190492 10476635 9805150 10363790 10657870 10320705 9971335 10612128 10091995 10113052 9549743 9858192 10127344 10402454 9671346 10143704 10874886 10544650 10145241 10882555 1073