(29, 'KLASIFIKASI BERITA PALSU PADA BERITA ONLINE BAHASA INDONESIA MENGGUNAKAN METODE SUPPORT VECTOR MACHINE DAN NAIVE BAYES', 'Spreading fake news or hoax news is now increasingly unstoppable. The rapid growth of unverified websites has made this problem even worse. For this reason, it is necessary to have a system that can classify news based on text, which can be a filter media for those news. One of the most frequently used methods is the Naïve Bayes method which is known to be able to provide the best results for classification of false news in general. But it is still weak for news classification with certain topics. To overcome these shortcomings, in this study the system was made to classify news topics in advance using the Support Vector Machine method. The SVM method was chosen because it has been proven to have high accuracy for the classification of Indonesian language news. Then, to increase the accuracy of the results of this classification, a combination of TF-IDF and Mutual Information is also used as a feature selector. The results of performance measurements using the SVM and Naive Bayes methods for classification of false news or hoaxes with three predetermined categories namely health and food, politics, and figures, obtain an average value of accuracy = 81.33%, precission = 75.31%, and recall = 96%.', '10923278 10866492 9801307 9553517 9877061 10322915 10026624 9898860 9650654 10017002 10191385 11035249 10254485 9878385 10632109 10191896 11048000 10318230 9909528 9848236 9788172 10329965 10202941 10780442 11308582 10839883 11230773 10848069 10655447 9527340 9746175 10061254 9735149 10176284 9865912 10267170 10976816 11139825 10386727 10840676 10080019 10204203 10005505 9903891 10066431 9864584 9869892 10419776 10104449 10424378 9543873 9828841 10081814 10956064 10621019 9745835 10052744 10810696 10893000 10997540 10065940 9852345 9808716 10843514 10858294 11322828 11196300 11059740 9986305 9814506 9816426 11036360 10260023 10284587 10630976 1018