(30, 'KLASTERISASI BERITA OLAHRAGA BERBAHASA INDONESIA DENGAN METODE K-MEANS YANG DIMODIFIKASI', 'Various sports such as soccer, table tennis, badminton, etc. require that every sports news be grouped according to its branches. Therefore we need a way to classify sports news that has something in common. Grouping can be done by many methods. One method that can handle this problem is k-means clustering. K-means clustering is a grouping method that can work with large datasets efficiently. However, this method has problems when determining the initial cluster center. The final cluster results of k-means depend heavily on this initial determination. The cosine similairty method can help k-means clustering get a good cluster center. In this study the grouping of Indonesian-language sports news is done by the k-means clustering method which has been modified with cosine similarity. The results obtained from the experiment are the best cluster center produced by the k-means method always changes, depending on the initial determination of the cluster center. After modifying the initial determination, the best cluster center tends to be constant, namely 4 cluster centers with an average accuracy value of 0.895.', '10931029 10905244 11166946 11205586 11106152 10608983 9685648 9756466 10110571 10968015 9527685 9747905 10104548 10036160 10670275 10382735 9569066 9564190 9930439 10370968 10839332 10827689 10779171 10104962 11071796 10389336 10124710 10930874 10904485 11163153 11110756 10632022 10191472 11037405 10265248 10928742 10719199 9846099 9777471 9824970 9687353 9762550 10080055 9814506 9816462 11037219 10264336 10306170 11170526 11163149 11110639 10631429 10188506 10963303 9894754 10650772 10675847 10646810 10265403 10932596 10815584 10328031 10154515 10113521 10260584 10030880 10538242 10113195 10252358 9825192 9692981 9903248 10081814 10956052 10620696 9744202 10011965 10455978 9837650 9735241 10785681 9877075 10713610 11200247 11079469 10084946 10327370 10138049 112