071 10814613', '2019-11-02 22:51:49', '2019-11-02 22:51:49'),
(31, 'KOMBINASI ANTARA TERM WEIGHTING DENGAN INTEGRATED COLOR AND INTENSITY CO- OCCURENCE MATRIX UNTUK DUA LAPIS TEMU KEMBALI CITRA PADA MEDIA SOSIAL TWITTER', 'Content Based Image Retrieval (CBIR) is one of the techniques used to search content-based images. Although the search results from CBIR are relevant to the query given by the user, sometimes the results are not what the user wants. So as to overcome these problems in this study two layers of retrieval systems will be used that combine text retrieval with the Vector Space Model (VSM) and weighting using Term Frequency - Inverse - Document Frequency (TF-IDF) combined with CBIR using Integrated Color and Intensity Co-Occurence Matrix (ICICM) as a feature extraction method for images. The features used in ICICM are texture and color which are two low-level features that are often used for image classification and retrieval. The purpose of this study is to combine the two layers of the retrieval system, namely text and content based to get better retrieval results. The data used in this study came from social media Twitter with a text query in the form of \"Madura tourism\". The results obtained from this study are that using a combination of text based with content based can improve the precision and recall of retrieval results even without searching in the entire dataset. The results obtained in this study are by using a combination of text based and content based, the results are better than using text based alone, with an increase of 0.0576 for precision and with the same recall. Whereas by using a combination of text based and content based the results are better than using content based alone, namely an increase of 0.0238 for precision and a recall of 0.2000.', '9901053 10808175 10048730 10790630 9610142 9769563 9864694 9870446 10289846 9590575 10062351 10077498 10141168 10951668 10227195 10120464 9652906 9682624 9741355 10425630 11032057 9847886 9786420 10260340 10415352 11061249 10125574 10952456 9840515