(32, 'Lokalisasi Teks pada Scene Text Image Menggunakan Directional Discrete Cosine Transform (DDCT)', 'Text is often found in various places such as street names, shop names, banners, road guides, warnings, and so on. Text detection is divided into three approaches namely texture approach, edge approach, and connected component approach. The texture approach can detect text well, but requires a lot of training data. Text localization is a basic step in many computer applications including Video Optical Character Recognition (OCR), to understand video content, and so on. This study aims to localize text in images. The method used in this research is Directional Discrete Cosine Transform (DDCT) and connected components. The dataset used is the ICDAR2013 Focused Scene Text Robust Reading Competition dataset which has 233 data in the test data. The results obtained with the average value of this study were precision 0.36, recall 0.91 and f1 score 0.45. The precision value is lower because many non-text components are localized. Whereas the recall value is higher and many texts are localized.', '10209325 11093168 10153437 10923534 10588970 9976215 10343569 9530446 9761706 10136771 11230840 11232422 10889321 9915470 10124340 10531006 9686392 10129197 11043071 10293595 10843073 10530545 9684085 10071494 9600539 9721556 10617610 10119403 11144007 11022675 10582226 9551870 9868844 10281817 10171105 9840005 10137635 11235153 9785766 10660400 10333366 10287876 11103831 10206754 11028910 9832161 10098415 9882855 9961268 10360450 10574355 9903122 10453222 10159349 9781231 9765734 9766274 10940846 10954345 10578056 9531025 9764616 10131724 11106202 10218622 11325599 11315606 10875002 9843859 10954330 10577616 9528802 9753497 9853724 9815606 10940844 10954331 10577685 9529151 9755229 9897031 10707624 10569481 9878764 9940807 9848965 9791801 9896615 10697302 10792597 10603724 10049981 10796877 10940861 10954406 10579616 9538822 9803599 10346221 10940845 10954326 10577581 9528629 9