(33, 'PEMANFAATAN METODE SMART (Simple Multi-Atribute Rating Technique) UNTUK MENENTUKAN POSISI PEMAIN PADA OLAHRAGA BASKET', 'In basketball, a player sometimes has several positions to play. When entering the basketball team a player is in the desired position. After becoming a professional player the player sometimes changes position from the proper way. A coach will determine the correct player position in the game by looking at the player\'s data. It is this task that sometimes makes it difficult for the coach to make the right decision by assessing the player objectively. In addition, in general the decision making process still relies on the instinct of the trainer. Therefore, the presence of a decision support system technology determines the position of a basketball player by a coach is certainly very helpful to achieve maximum results in each match. The technology that the authors offer is to build a decision support system for the selection of player positions derived from player data using the SMART method. This system applies the SMART (Simple Multi-Attribute Rating Technique) method which aims to provide recommendations to coaches for the selection of the position of each player, as well as knowing the position requirements of five suitable players to be placed in the center, point guard, shoting guard, small forward, and power forward positions . From the results of the SMART (Simple Multi-Attribute Rating Technique) can be implemented in the player\'s position selection system and has an accuracy of 61% obtained from the comparison between the results of the calculation of the system with the trainer\'s recommendation data.', '9614237 9790043 10376727 10086868 9594181 9689756 10558269 10603957 10412095 9873080 10108935 10927165 10885940 10430418 10370431 10823890 10832306 10411644 9870825 10052528 10809613 10084675 10320636 9969703 10376731 10086881 9594494 9691332 10566143 10643312 9833506 9714519 10682070 10411745 9871330 10065171 9833012 10102671 1