(35, 'PEMETAAN POTENSI TAMBAK GARAM DI PROVINSI JAWA TIMUR MENGGUNAKAN SINGLE LINKAGE', 'Salt is a strategic commodity, East Java Province is one of the largest national salt suppliers whose production centers are in Madura. Madura is an area that has the potential for salt production so that Madura has always been known as a salt island. However, salt ponds as a land for producing salt do not all have good potential because they have differences from the technical aspects that affect the productivity of salt ponds. To find out which salt ponds have similarities from technical aspects. Grouping is done by using cluster analysis. Cluster analysis is the grouping of objects into smaller groups where each group has similar objects to each other. the grouping process is done for salt ponds in East Java by using the Single Linkage method. Single Linkage Method is a Hierarchy method that groups an object that has the closest distance first or the greatest similarity. This is influenced by distance calculation using Euclidian Distance and mapping utilizing Geographic Information System technology in spatial data of salt ponds. Clustering Using Single Linkage can be measured using the Silhouette Coefficient method. The results of this study indicate the value of 0.9361 Silhouette Coefficient in salt pond clusters in East Java Province with an accuracy value of 93.61% and categorized as strong structure', '9717951 10699231 11231395 10863594 9786831 9905804 10076006 9713255 9894516 10644856 10646252 9906991 10472561 11347277 9854487 9819422 11111231 10243773 9812720 9771774 10968346 10928037 10310973 9728070 9968591 9762297 10073735 10134411 11173422 10554718 9804955 10358843 10534270 9702717 10623072 9718093 10699945 11249244 10919287 10846549 10482856 10226880 10118892 11141434 10958410 10679665 10039049 9961215 10359181 10542710 9744909 10052767 10810810 10114699 11071194 10434192 9592935 10074167 10839217 9664932 9592721 10073077 10811971 9528721 9753081 9843316 9763560 1