(36, 'Pemilihan Striker Pemain Sepakbola Dengan Menerapkan Metode WP (Weight Product)', 'Striker is a player who is in the front row and dealing directly with the opposing defender, his job is to put the ball into the opponent\'s goal. A striker must have good shooting or kick accuracy. Not only that, a striker must also be able to open up the space to shoot and create good opportunities for himself so he can score goals, for that requires a good foresight from a football coach in terms of choosing a striker. A coach in choosing a striker does not just rely on his observations, but must see significant data records that can support the decision, so a decision support system is needed to resolve the problem. This system applies the WP (Weight Product) method whose aim is to provide recommendations to the coach for each player\'s position selection, as well as knowing the needs of which team of players is suitable to be placed in the striker position. From the results of research WP (Weight Product) can be implemented in the striker selection system and has an accuracy value of 55% obtained from the comparison between the results of the calculation of the system with the trainer\'s recommendation data.', '11235332 10962062 10279181 10105144 10832349 10411856 9871890 10079194 10183649 10841826 10849852 11090695 10922335 9777740 9678514 10322829 10024538 9888436 10379791 9886072 9977346 10762455 10858903 10926301 10881607 10322040 10004726 9789369 9884451 9969241 10002553 9830127 10088251 10409987 9859698 11017351 10981322 9594221 9689965 10559301 10609115 10858191 10908578 10793001 10605727 10059993 10846955 11018319 10169825 9715011 10684544 11235323 10961866 10278180 10080179 10208266 10676085 10021160 10295247 10851340 10897424 10326857 10125144 10160549 9787217 9524791 9733445 9995466 10824825 9592982 10074386 11235331 10962061 10279165 10104812 10824009 10760771 10053970 10816829 10655766 9528946 9754204 10099259 10294577 10848001 10880731 9909526 9848180 9787886 