(37, 'PEMODELAN DAN ANALISA SIMULASI PROFITABILITAS PERUMAHAN DENGAN PENDEKATAN SISTEM DINAMIS', 'The housing property business sector has a significant impact on the value of profits, this is evidenced through research in the field which shows that the costs required to build housing are quite large and take a long time. Increased consumer demand for housing also has an impact on increasing the value of profit, thus encouraging developers to add the type of housing that consumers are interested in.\r\nTo find out the increase in the value of profit, then made a system that is able to analyze the level of effectiveness and efficiency in estimating the value of profits obtained. The method used in making the system is simulation modeling and analysis with a dynamic system approach through several scenario models namely structure and parameter scenarios. Modeling is described in a causal diagram and then developed through a flow chart.\r\nBased on the simulation results to increase the value of profit, it can be done by adding promo furniture variables that are applied to the structural scenario, while the parameter scenario there are three conditions including an optimistic scenario an increase of 34.6%, the most likely scenario shows an increase of 14.81% and the scenario pessimistic with an increase of 4.91% from the initial profit value. For housing types that have a high profit value, it is indicated by Cheryl type housing with a building area of ​​223 out of the four housing types in block Xa with an average profit of Rp. 24,222,060,000.', '10313377 10941999 11050642 10331436 10239711 10964301 10826882 10775150 10125855 11176260 11350151 9926340 11049801 10327229 10134541 11176710 10961780 9887128 9982625 10894377 11031924 10237842 10173695 10202435 9996659 9682757 9742009 10819536 10332824 10648606 9575140 9985191 10958576 10683845 10059950 10456101 11012549 10140971 10165514 9812046 9997845 9712352 9889999 9996969 10081097 9840551 9749738 9759690 10008506 9978