(38, 'PEMODELAN DAN SIMULASI SISTEM DINAMIS UNTUK MENINGKATKAN PROFITABILITAS PRODUK PANGAN', 'In food production such as chip production, it will definitely experience ups and downs in product sales, this will certainly have an impact and affect the level of profitability of chips. To find out the profit value of food chips, a system can be analyzed. The method used in making the system is a dynamic system simulation method with 2 scenario models namely packaging and price, and material added scenarios. The results of the simulation of the material added scenario results in decreased profits ranging from -1.67 percent to -8.35 percent. The packaging and price scenario of profit increases ranging from -6.23 percent to 18.71 percent. For businesses to get high profit increases, business actors can make changes to packaging and raise prices. In this study also sought products that should be superior products using a dynamic system simulation model and obtained results of research with corn chips into superior products. Furthermore, to find out how to predict the accuracy of the system is to use an average ratio and amplitude variation and the average yield is 0.96911% smaller than 5%, and a comparison of the amplitude variations is 17.0283% smaller than 30%.', '10130005 10672684 10004161 10958410 10679665 10039049 9961225 10359422 10548731 9775005 10203267 10391434 10941661 10039051 9961362 10362794 10632976 10196240 10765971 10079972 10203100 9999975 9765674 10156605 10947062 10005356 10964380 10828934 10958420 10679843 10039941 9983580 10918282 9669632 10100786 10332737 10648162 9564029 9929636 9569666 9945466 9883688 9965427 10464481 10135007 10016441 10629177 10958483 10681458 10048020 10396466 9521729 9718124 10309475 10471925 11344102 9775060 10203525 10392737 10948174 10033132 10322015 10004182 10958521 10682430 10052874 10420724 10128112 10625365 9767571 9775470 10205591 10403056 10999764 11248917 11322820 11196093 11058711 9981177 9686280 9735771 10788346 115