(39, 'PENAMBAHAN FITUR ENKRIPSI RIVEST CODE 6 WEBSOCKET UNTUK PENGAMANAN ALIRAN DATA MESSAGING', 'The WebSocket protocol provides two-way realtime communication. However, by implementing the WebSocket protocol, security threats will be more numerous. One of the attacks that often occurs is packet monitoring carried out by irresponsible parties. To maintain the confidentiality and authenticity of data from the attack. One technique that can be used for data security is to apply the encryption method. In this research the encryption method used is Rivest Code 6 (RC6), the method has a high performance in the process using primitive operations, so it does not greatly affect the performance of the websocket protocol. The results of the avalanche effect trial showed that the total change for the Rivest Code 6 (RC6) algorithm based on the plaintext was 28.29% and based on the key was 52.28%. As for the Transport Layer Security (TLS), the total change obtained is based on the plaintext of 42.50% and based on the key 53.19%. The results of testing the speed of the delivery of messages obtained the average value of the overall time of sending messages amounted to 10673 milliseconds for Transport Layer Security (TLS) and 6964 milliseconds for Rivest Code 6 (RC6). The modified web library library is also capable of encrypted communication on the condition of the communication link with a packet loss probability level below 12%.', '9866296 9878467 10634231 9811896 10141804 10967638 10910399 10651274 9897092 10709269 11358946 10927368 9903635 10872771 9832704 9710506 10662014 10301012 9869705 9895499 10669326 10768610 10622165 10142180 9695384 9805157 10363941 10661671 10339715 10683066 10436660 9995903 10054521 10819578 10333886 10300877 10910376 10650637 9893924 10629991 9891121 10002584 11002771 10482702 11398001 11122585 10300542 9857946 9836719 11153022 10843350 10537476 10109371 10937984 10950250 9829486 10972119 9548212 9850549 10580985 10619032 9735884 10007652 11129421 