(40, 'Pencarian Teks Menggunakan Metode Enhanced Confix Stripping Stemmer Dan Cosine Similarity Pada Terjemahan Tafsir Al-Quran', 'Al-quran is a holy book that is a guide for the people\r\nIslam. The Qur\'an has also been translated into various languages\r\nto make it easier to understand the meaning of each verse in the Qur\'an. However, there are still many who do not understand the meaning of the translation of the verses of the Koran, so that a detailed interpretation or explanation is needed. Along with the development of technology, many interpretations of the digital al-Qur\'an have been equipped with a search system. However, there are still difficulties in finding an interpretation of the Qur\'an in accordance with the topic or topic because one letter with another letter has similarities and differences in certain topics. Therefore proposed a text search system using Information Retrival that allows users to find information that is relevant or as needed. This research uses the Enhanced Confix Stripping Stemmer method which is used for the process of forming an accurate base word and the Cosine Similarity method to calculate the similarity of a query to the keyword query in the database. Based on the results of testing the system using Enhanced Confix Stripping Stemmer stemming obtained an accuracy value of 71.96% and the level of ability to retrieve all relevant verses (recall) 98.64%, while without using stemming obtained an accuracy value (precision) of 82.95% and the ability level to take all relevant verses (recall) of 76.70%.', '9709204 10655506 11090138 10847903 9708376 10288187 10720932 9820800 10754992 10415686 10281666 10167318 9821066 10042935 10058433 10836419 10432208 9973657 10415274 10382445 9724841 10733694 11090442 10855465 9746183 10840387 10854106 9739380 10806383 10394545 9785328 9868257 9888263 9707195 10258691 9592917 10074067 10136061 11214627 10760750 10444480 9644376 9860087 9847420 9784075 10227494 10121960 11156791 10560995 9836