(41, 'PENDETEKSIAN DAN PENGENALAN KARAKTER PLAT NOMOR  KENDARAAN MENGGUNAKAN BACKGROUND SUBSTRACTION DAN AREA-BASED FEATURES EXTRACTION', 'The increasing number of vehicles, especially four-wheeled vehicles in big cities, has caused traffic problems, including toll roads. With a fast transaction process at the toll gate entrance, it can reduce the queue of traffic jams. For this purpose, an application for processing image recognition of vehicle number plates is needed. In this research, a number plate character recognition application is made in the vehicle image starting from the location plate detection process using background substraction. Furthermore, the segmentation process for each character and the last process is the introduction of character number plates using area-based features extraction. The data used in this study are 50 vehicle images, each of which has 3 distances, namely 50 cm, 75 cm and 100 cm. The results of this research trial show the best level of accuracy in scenario 1 with a distance of 50 cm with an accuracy of location plate detection accuracy of 94%, the best character segmentation accuracy of 89.58% and 82.59% for accuracy of character recognition.', '10318230 9909528 9848242 9788194 10330441 10214838 10839916 10451650 9680224 10119978 11146866 9922327 10158621 9825599 10093799 10158081 10946763 11169680 10102066 9885434 9974150 9901228 10053116 9922323 10158595 9824864 10075366 9697276 10010699 9819217 10424327 10218226 10075605 9703319 9844817 10964787 9902165 10057799 10820649 9572106 9970003 10006373 9925564 10956060 10620885 9745149 10035632 10725135 10316510 9866506 10660766 9879173 10333479 10290752 10785040 10565927 10642232 10587741 9579446 10006719 9934195 9827340 11246172 11233036 10852785 9732786 10773415 9570424 9961606 10368871 10784965 10956191 10624188 9761673 10136593 11227926 11217856 10776881 10525140 10438316 10004194 9786692 9902324 10058596 10839969 10843580 9686767 9747896 10067718 9896761 10030797 9754921 10102