(42, 'Penentuan Posisi Pemain Bertahan Pada Sepak Bola Menggunakan Metode MAGIQ (Multi-Attribute Global Inference Quality)', 'In a soccer game a coach will determine the exact position of the player in the game by looking at the player\'s data. Sometimes the player\'s position does not match his abilities. Things like this that make it difficult for coaches to make the right decisions by assessing players objectively and not just using instinct in determining the position of players, especially defenders who become a bastion of defense for a team. Therefore, the presence of a decision support system technology determines the position of a defender in football for a coach is certainly very helpful to achieve maximum results in each match. The technology that the writer offers is to build a decision support system for the selection of defensive players\' positions derived from player training data using the MAGIQ method. This system applies the MAGIQ (Multi-Attribute Global Inference Quality) method because in its weighting it ranks priorities for each factor and criteria and will be processed using the ROC (Rank Order Centroid) concept. The final result of the MAGIQ method itself is to produce an accuracy of 65% of the results of the system recommendations with the trainer\'s recommendations in the field.', '10608669 9684071 9748579 10071131 9981984 9675649 9860576 9849871 9528644 9752704 9833860 10106901 10095025 10579334 10318661 9920321 10148595 9574891 9983935 10927165 10885937 10430312 10367881 10760198 10411794 9871571 10071193 9983556 9683506 10057085 10412168 9873437 10117881 11136394 10832412 10412171 9873470 10118641 11140185 10885934 10430201 10364999 10688058 10471645 9780208 9740216 9521651 9717745 10307591 10424775 10229403 10131505 11100767 10191442 10332311 10261505 10444487 9644415 9860987 9851918 9970504 10008881 9988234 10643971 9849959 9530817 9763561 10105251 10444375 9643865 9847261 9783290 9817297 10414725 10368801 10783215 9815385 11010252 101