(43, 'PENENTUAN PRIORITAS PERBAIKAN JALAN DENGAN METODE FUZZY C-MEANS DAN SIMPLE MULTI ATTRIBUTE RATING TECHNIQUE (SMART) (Studi Kasus Dinas Pekerjaan Umum dan Penataan Ruang (PUPR) Kabupaten Bangkalan, Jawa Timur)', 'The Bangkalan Regency Public Works and Spatial Planning Office (PUPR) is responsible for repairing district-level road damage. In handling there are several obstacles including limited funds from the central government and the large number of damaged roads. Therefore, research needs to be carried out to determine the priority of road repair by taking into account the existing criteria including the length of the road, the width of the road, the length of each condition (good, moderate, lightly damaged and heavily damaged). In this study two methods were combined: Fuzzy C-Means (FCM) and the Simple Multi Attribute Rating Technique (SMART) Method. FCM method is a method that is able to group data based on its characteristics and SMART is a method that is able to solve problems with multi criteria. By combining the two methods in determining the priority of road improvement produces an accuracy rate of 80%. This accuracy value is obtained by analyzing the level of equality of the results of calculations performed by experts in the Public Works and Highways Department of the City of Surabaya on the system that we created. Making this SPK has a level of conformity as what is desired by the user / user by 73.4% based on a questionnaire against 6 respondents.', '9596437 9701045 10104921 9654891 9732299 10770991 9900452 10011898 10063699 10968181 9752077 10208865 10028812 10877151 10601272 11126202 10709243 9796312 10142835 9698655 10602760 10382126 9723232 10659540 10329049 10179967 9968622 9999474 9753146 10093970 11016837 10968465 10931055 10124123 10916216 10831194 10796696 10152432 9746640 10072925 10026903 9657555 10397265 10322944 10027349 9902486 10450038 11234666 10945466 10196188 9965429 10464502 10135110 10018972 10641844 10577938 9530416 9745392 96