(44, 'PENERAPAN ALGORITMA APRIORI DALAM PENCARIAN BUKU PADA PERPUSTAKAAN SMA NEGERI 1 PORONG', 'Porong Public High School 1 Library has various collections of books to support teaching and learning activities. In the activity of borrowing books, students usually ask friends who have borrowed certain subject books to get references on what books are usually borrowed so that it makes finding books in the library easier. This research can apply and develop a decision support system that is able to provide information to library visitors about book recommendations that can be borrowed. This study uses a priori algorithm to get the rules that are used as recommendations. The results of experiments that have been carried out with a priori algorithm, from the test scenarios that have been concluded, the greater the minimum value of support and the minimum confident value produces fewer rules and the time required to obtain rules is also shorter. The results were obtained from the test results with the provisions of suppot values ​​3, 4, 5 and 6 with a 70% confident value in getting a response time of 0.0200012 (support 6) seconds, response time 0.00330021 seconds (support 5), response time 0.00340021 seconds (support 4) , response time 0.0760038 seconds (support 3).', '10885108 10800220 10641824 10240474 10968100 9749994 10156774 9768349 10169981 10109563 10313489 9790995 10283198 10596242 9621949 5922366 10169131 9830138 9816591 11192429 9889535 10520290 10414065 9882923 9961601 10368812 10783490 9822322 10793096 10606219 11234336 11249921 10936127 10930734 10903774 11159600 11021903 9797123 9532591 9772427 10190374 10326980 10128260 9847737 9785659 10657785 10320293 9961091 9571185 9965401 10463822 10424286 10217168 10070320 9571201 9965478 10465744 10472406 11346524 9835610 10896903 11095051 10944116 10322300 10011316 10793026 10605865 11232566 11241070 11105499 9824475 10059976 10846865 11015990 10158173 10204994 10009459 10002774 9835580 10896765 11091683 10927271 990