(46, 'PENERAPAN ARSITEKTUR MODEL VIEW CONTROLLER PADA MANAGEMENTINVENTORY LOGISTICRUMAH SAKIT ( STUDI KASUS RSUD dr. H. SLAMET MARTODIRDJO PAMEKASAN )', 'Inventory control system (inventory logistics) is a system to find out inventory taking inventory of goods at a place. Because there are several problems, namely the difficulty in knowing information on demand, receipt, usage, and stock of consumables (BHP). This is because the data has not been stored in a good file and BHP inventory data management is still done manually (inventory card), in the process of supplying goods in warehouses to become a single user in carrying out inventory taking inventory BHP cannot be used for multiusers so that the service and Head Logistics cannot directly access BHP\'s stock taking report. Problems like this require a computerized and web-based system. The system development methodology used in this study is the waterfall method which includes, system analysis and engineering, needs analysis, design, programming, testing and maintenance. Inventory Logistic Management System has been deemed appropriate this can be seen in user satisfaction with an average survey value of 7.88 and a trial system that can run well. This application can significantly simplify the work distribution of goods distribution and making reports on the distribution of goods in the hospital environment. dr. H. Slamet Martodirdjo.', '10371069 10839841 10059131 10842640 10910444 11192956 9902680 10841646 10848970 11068681 10812264 10702050 11322860 11197191 11064190 10008566 10059176 10842858 10915840 11219941 10577274 10135665 10444071 11102466 10199931 9984139 11248922 11322840 11196650 11061480 9995010 10032191 10317315 9886691 10059202 10842992 10919185 11236653 10995085 9663043 10326690 10121066 10059151 10842741 10912890 11205187 10208437 10680271 10042092 10818606 10343128 9528248 9750716 10081814 10956060 10620855 9745002 10031915 10706549 9851918 9970526 10008987 9990961 10712225 11373735 10515870 1078