(47, 'PENERAPAN AUGMENTED REALITY PADA GAME EDUKASI 3D PENGENALAN GIGI', 'Teeth are one of the vital organs in the body. That\'s because dental health can affect the quality of life of individuals. Teeth are very susceptible to interference, especially in adolescence. Therefore it is very important to introduce children to the procedures for caring for teeth from an early age to avoid disturbances in the future. To overcome this problem, then made a 3D educational game application that introduces the teeth and treatment procedures. This application applies Augmented Reality technology and is created using the Unity3D game engine with the addition of the LeanTouch library as an interaction between the user and the Augmented Reality object displayed. This educational game runs on an Android device. By using Augmented Reality technology and the LeanTouch library, making the application more interactive and will certainly be more interesting for users, especially children. This was evidenced by the results of the user experience test with the Likert scale calculation to get a total score of 570 from 20 respondents who have tried this application. In this research the Likert scale is used to measure the attitudes, opinions, and perceptions of users towards the application. From the total score, it can be concluded that the user understands the material presented in the application and the user feels very satisfied with this application and a very positive response.', '9914302 10118493 10384869 10403587 9699715 10608048 10852851 9993771 9734580 10782376 9794441 10095993 9822321 10049202 10792993 9669259 10091437 9832287 9708411 10651529 10038918 9569707 9946393 9888320 9988591 11043613 9684702 10477535 11372160 10476480 10195018 9959570 9954200 10317992 9903518 10455205 10208931 10029131 9713334 10676160 11045325 9914224 10118096 10374951 11249860 10934598 9751216 10084310 10968535 10151556 9742269 9963586 10364919 10809071 10071174 9983077 10071735 9997163 9695320 957109