(50, 'PENERAPAN ITEM ATTRIBUTE DAN FUZZY C-MEANS CLUSTERING DALAM MODEL ITEM-BASED COLLABORATIVE FILTERING UNTUK REKOMENDASI FILM', 'Collaborative Filtering (CF) is the most widely used recommendation model by calculating the similarity between users and items. This model assumes that some people who like the same things tend to be equally like the other things, so the recommendations produced will be more varied. But CF has two main problems, namely sparsity and scalability. To overcome sparsity, it will fill in the blank rating matrix using the calculation of item similarity and item attribute similarity. Then solve the scalability problem by applying Fuzzy C-Means clustering so that the calculation process only processes really similar items in the same cluster. From the system implementation that has been done, the sparsity problem can be solved by calculating the combined similarity between item similarity and item attribute similarity with the density level that was originally from 5.04% to 100%. While the scalability problem can be solved by applying Fuzzy C-Means clustering with faster computing time of around 25.74%. Based on the f1-score evaluation value, CF Clustering produces the highest evaluation value of 5.434 and the Traditional CF model produces the highest evaluation value of 2.307. This shows that in this study the CF Clustering model produces recommendations that are better than the Traditional CF model.', '9888994 10506701 10346110 9543168 9825316 10845432 9808308 10442756 9897700 10035485 10333778 10653364 10084729 10321975 10003113 9781311 10234794 10167329 9821131 10043264 10763304 10880090 9869300 9893472 10618735 10515661 10000290 9773531 9805255 10366363 10722167 10642193 10632939 9805437 9964793 9667301 9664735 9978403 10398255 9803884 10332108 10256424 10317491 10281747 9778726 10484460 11406780 11342056 11007264 10114560 11067781 10417130 10038238 10738162 10642240 10633192 9806694 9971071 9824337 11231161 11234041 10539193 10117941 107