(51, 'PENERAPAN LEAP MOTION CONTROLLER PADA VIRTUAL REALITY ANATOMI ORGAN JANTUNG DAN PARU-PARU 3D', 'Anatomy learning uses a variety of methods, ranging from dissecting corpses to medical imaging techniques including X-ray, ultrasound and magnetic resonance imaging. In general, the conventional method of studying anatomy is reading and memorization. The latest learning methods use multimedia technology by utilizing 3D objects. So that 3D objects can be explored interactively a motion sensor is used. One of the motion sensors is the Leap motion controller. 3D organ objects that can be explored using the user\'s hand gestures as input, are simple but nearly real learning methods. This is more value than conventional learning methods by reading and memorizing. In this study applying modern learning using integrated 3D objects Leap motion controller and displayed with virtual reality that was built using Unity3D. The development of Leap Motion Controller and Unity3D has produced interactive virtual learning media of the heart and lungs in humans. From the results of the performance test, the pointing feature is 100% successful. User experience test results show that importance points are 88.23%, valence points are 94.11%, control points are 97.05%. In conclusion, the material presented is delivered, the application is fun and not boring and the User can control the application freely.', '9689813 9824052 10836355 10822505 10407028 9847758 9785762 10660350 10333101 10281351 9768796 10236209 10165531 11374630 10538314 10113542 10261078 10043210 10846490 9701305 10111440 10322926 10026886 9900160 10438410 10960864 9882556 9959769 10323025 10029370 9912584 10891146 10951130 10106967 10487320 9858584 9839892 9669795 9677210 10290256 9600754 10113249 10331980 10253263 9847886 9786420 10260330 10415149 11060228 10100135 10316510 9866510 10660789 9879706 10336147 10357456 10890192 9919825 11277547 10684720 10868609 9811892 10922925 10573746 9900085 9612109 10170021 10110586 101