(52, 'PENERAPAN METODE ECONOMIC ORDER QUANTITY & SINGLE EXPONENTIAL SMOOTHING PADA SISTEM PERSEDIAAN BAHAN BAKU', 'Raw materials are the main thing in companies, especially industrial companies, because raw materials are part of a production process that must exist and cannot be ignored. UD. Budi Jaya is a food company, especially snacks whose main raw material is salak fruit. At the site there is a salak plantation owned by the company and a source of raw materials where the trees bear fruit only in season. However, when the tree is not harvesting, the company must buy zalacca fruit from other providers, where the company spends more capital to buy raw materials. Therefore, this study aims to be able to control raw materials, by applying the Economic Order Quantity method which method helps companies to manage salak raw materials. And the Single Exponential Smoothing Method to support the calculation of Eqonomic Order Qunatity. Based on the results of research conducted at UD. Budi Jaya, that using the Economic Order Quantity method produces more efficient raw material requirements. In 2014, the company was able to minimize the salak raw material by 662.2 kg, in 2015 by 351.6 kg, in 2016 it was 628.3 kg, and in 2017 it was 589.3 kg. the cost of purchasing raw materials can be minimized In 2014 of Rp. 1,409,618, in 2015 amounting to Rp. 2,312,449, in 2016 amounting to Rp. 2,596,150, and in 2017 Rp. 2,496,757.', '9856450 10474343 9793705 10077642 10144810 9708541 10652184 10445860 9651278 10365864 10813806 10189557 10322882 10025830 9894876 10653830 9705775 10223200 10100491 10325450 10089968 11234181 10933307 10135382 9661395 10653839 9705954 10227617 10122576 10877519 10077657 10145236 9710667 10662824 10711880 9809517 11157059 10958410 10679665 10039062 9961606 10368871 10784965 10956176 10623855 9760015 10128316 11021085 10183648 10451260 11240780 11098252 9788256 9878877 9863171 10251805 9852874 9603764 10128307 10630145 9791471 9894970 10656147 9763652 10927750