(53, 'Penerapan Metode Ekstraksi Ciri Color Moments dan Color Co-occurrence Matrix', 'The process of searching for image information based on text is not efficient. To streamline image search you can use image queries (Content Based Image). This study uses two methods of color feature extraction namely the color moments and color co-occurrence matrix methods. As for calculating the similarity of image queries with images in the database using Euclidean Distance. The level of accuracy is measured using Precission and Recall. The dataset used in this study is the Wang dataset with 1000 images. The dataset is divided into 2 parts, 30% (300 images) as testing data and 70% (700 images) as training data. In this study, there were 3 trial scenarios, namely only the Color Moments, Color Co-occurrence Matrix and the combination of Color Moments and Color Co-occurrence Matrix. In this research, the highest accuracy value is obtained by combining feature extraction using Color Moments and Color Co-occurrence Matrix to get a Precision value of 48% and a Recall value of 21%.', '10956190 10624102 9761249 10134469 11174850 10952485 9840653 9750245 9772392 10190188 10326041 10104785 10289652 9585719 9956117 10327576 10143161 10872165 10476587 9804925 10358105 10515806 9610400 9770866 9897257 10033262 10207174 11039351 9884365 9968816 10000445 9777444 10061702 10855494 11231745 10872401 9830860 9701284 10501438 10319791 9948576 10289852 9590719 10063074 10081100 9840642 9750188 9770943 10182957 10289886 9591575 10067351 10102495 11059449 10080640 10219806 10083515 9901053 10808175 10048730 10790630 9610142 9769563 9864695 9870466 10289947 9593046 10074714 10139296 11243471 11165531 10124630 10538299 10113481 10259551 10005072 9893027 10607622 10850724 9940581 9859275 9843366 11319192 10892934 9933536 10214660 11226540 10820299 9570356 9961263 10360369 10572381 9893264 10613465 10879941 10671074 10527513 10059551 10844744 10962956 9893016 10607244 10848837 9893484 10618965 9735549 10