(54, 'PENERAPAN METODE FORWARD CHAINING UNTUK DIAGNOSIS PENYAKIT KULIT PADA KUCING', 'Diseases that are often suffered by cats are skin diseases, including mycosis, otitis externa, echoarasitic infections (SPP / Scabies notoedress mites, echoparasitic infections (SPP demodex mites), allergic dermatitis, acne / comedones. This disease is very often encountered by the cat lovers in their favorite cats, but the lack of understanding of skin diseases in cats is still low, so there are still many people who still rely on the expertise of an expert directly besides the costs incurred are also not cheap, and the existence of veterinarians is still relatively small. From this problem, a system of expert diagnosis of cat disease was developed using the forward chaining method, an expert system is a system that attempts to adopt human knowledge into a computer, so that the computer can solve problems as is usually done by experts. Forward chaining is a search technique that begins with the facts in the know. So that it is hoped that from this study it can facilitate the public about the diagnosis of skin diseases in cats. And from this research can be known the accuracy of the forward chaining method that is equal to 100%', '9891245 10393840 9846687 9780412 10135919 11211080 11133624 9965092 9981826 10065495 9841182 9752890 9702060 9838525 11198140 11068926 10422852 10317500 10393830 9846399 9778978 10100135 10316510 9866499 10660741 9878506 10330145 10207390 10802686 9911585 10886166 10436040 10901625 10431931 10408330 10208836 11080874 10091981 10503249 9547592 9784230 10249391 9751024 9791860 10422111 10162761 9798285 10319661 9945315 9882940 9961687 10370975 10837467 11171645 10936451 10932370 10911960 9638036 9518421 9701591 10118505 10775796 10910345 10649934 9890400 9998991 10131645 11104229 10599374 10418856 10081432 9848967 9791825 10287355 10700185 10370960 10837114 11162880 10892626 10713250 9816359 10019400 10641931 9850395 10189572 10599323 10418591 10074823 9683