(55, 'PENERAPAN METODE FUZZY  C-MEAN CLUSTERING UNTUK PENGELOMPOKAN DATA USAHA MIKRO', 'In the Office of Cooperatives and SMEs Bangkalan district has a lot of data including asset data, turnover data, the number of workers, the type of business activity, the name of the business owner, and the year the business was established with different values. From this problem to get the results of grouping the right microbusiness data, it is necessary to have a clustering using the Fuzzy C-Means method, the purpose of this study is to classify microbusiness data based on asset data, turnover and the number of workers. 300 micro business data. The results of the study indicate that the clustering based on the Fuzzy C-Means method gets 8 clusters with a sillhoutte value of 0.4314', '9968266 9997692 9708544 9870942 9901701 10824418 10762816 10064195 9808684 10452095 10131087 11090328 10529872 10071332 9596437 9701045 10104855 9653316 9692950 9902486 10450038 11234676 10945710 10197410 9971524 10616882 10897010 10316510 9866487 10660675 9876926 10322246 10009972 9815599 11015636 10156423 11329091 11333069 11061767 10777694 10919818 10105444 10839931 10452077 9682361 10130669 11200335 10868451 10383811 10122278 11158382 11260775 11382105 10725151 9875870 9926340 11049709 10326786 10123418 10898591 9571201 9965478 10465775 10473135 11350151 11049799 10327230 10134494 11175556 10956002 10619468 10128707 11190525 9841885 9756401 11049745 10326966 10127858 11009595 10126215 10968496 9530080 9759893 10404168 10104886 9899545 10044712 9712231 10670628 10125716 10956059 10620845 9744967 10031081 10702395 10138629 11240131 10691472 11037435 10265403 10932600 10815609 10328156 10157632 10191480 9941885 10657120 11049728 10326882 10125866 10959769 9877075 10713610 11200242 11079452 10084882 10325906 10101379 10272621 11519452 11815090 11419309 9831021 9838709 9740531 10812130 10538302 10113499 10260021 10016826 11021745 11091197 10924835 10874296 10139253 11243237 11159740 10095680 9814506