(56, 'PENERAPAN METODE LEARNING VECTOR QUANTIZATION UNTUK KLASIFIKASI KONDISI FISIK PADA PEMAIN VOLI', 'Volleyball can be regarded as one sport that has complex movements. A volleyball player must work hard to improve his abilities with one of them in physical condition. In determining the physical condition can utilize computer science in providing solutions and decision support for volleyball players. By applying the learning vector quzntization method, it can classify the physical condition of a volleyball player. The learning vector quantization method itself is a Supervised Learning classification method. With this system, it can help the coach to find out and give the portion of training to players who have physical conditions divided into several categories, namely very good, good, enough, less, and very less so that the determination of the physical condition of players faster. Accuracy results obtained by the classification of physical conditions in volleyball players using the learning vector quantization method that is 95% with alpha 0.1 to 0.5 and epoch 5 to 40 obtained from the comparison of manual calculations with the results of the classification system.', '10778168 10531573 10470479 10164996 9594262 9690174 10560345 10614326 9890015 9751046 9792461 9899904 10046506 10928932 10894768 11041700 9896109 10684648 10476189 10193546 10698691 10915445 9996201 10061923 10856591 11259228 10470477 10164993 9594181 9689756 10558269 10603964 10412269 9873952 10130667 11200324 10868080 10374532 10075899 9754606 9881466 10344927 10709108 10967520 10907395 9794935 9521651 9717745 10307587 10424691 10227330 10121124 10841193 10456064 11011640 10136425 9666605 9661266 9891661 10573425 9898476 10429996 10359894 10560500 9833860 10106905 10095153 10582614 10335066 10330455 10215092 10573442 9898576 10430485 10372145 10845222 10866836 11124631 10310764 10504152 9870106 9897519 10719899 11021475 11084365 10109424 10939342 9774949 9999398 9751200 10084230 10968135 1092275