(57, 'PENERAPAN METODE NAIVE BAYES UNTUK KLASIFIKASI KONDISI FISIK PADA PEMAIN BOLA VOLI', 'In an effort to achieve good performance in volleyball sports, players are not only emphasized in mastering techniques and tactics, but are required to be in good physical condition, because they are important conditions in mastering skills in volleyball games. A player needs good physical condition to improve the quality of technique. In this case the coach wants to know the extent of the physical condition of the players from each individual, by correcting the physical condition of a good volleyball player. To make it easier to find out the physical condition of the player, a decision support system is needed that can classify the player\'s physical condition. The method used in the decision support system is Naive Bayes. Naive Bayes is one of the methods in data mining to classify data. This method can help the coach in classifying the physical condition of each volleyball player where there are five categories: very good, good, enough, less and very less. From the results of the calculation of Naive Bayes method produces an accuracy of 85.71% where the value obtained from the comparison between system calculations with the results of manual calculations.', '9890234 9998149 10147100 10891851 10968841 9531808 9768526 10170866 10131637 9932169 10207822 10664969 9965579 10077570 10142971 10871223 10453113 9687548 9767451 10165478 10778168 10531573 10470480 10165012 9594719 9692461 10571795 10671587 10930937 10904806 11164756 11150835 10832401 10412114 9873182 10111417 10989230 10024397 10668961 10084009 9795142 10504241 9872269 9908325 9818153 11079506 10085129 10331980 10253263 9847886 9786420 10260341 10415359 11061286 10126524 10976289 9569046 9954718 10196765 9968314 10927205 10104878 11071376 10378805 9861414 9854066 10207945 10667999 9980717 10456064 11011640 10136425 9666605 9661266 9891661 10573430 9898509 10430157 10363969 10662402 10343370 10701341 10893506 11010175