(58, 'PENERAPAN METODE PROFILE MATCHING DALAM MENENTUKAN POSISI STRIKER PADA TIM SEPAK BOLA', 'Attacking players or who are often called strikers are players whose job is to score goals against the opponent. In placing the player in the position of an attacker a coach makes a subjective assessment so it requires a long time. Therefore we need a system that can help coaches in placing players as attackers. In this system producing qualified attacking players requires a number of criteria needed. Also needed a method in determining the position of the attacking players and in this study applying the profile matching method. This method is considered to be able to produce attacking players in accordance with the expected criteria. The calculation in this method compares the criteria of the player with the expected target criteria. So that you will get the same results as expected players. The results of this study are in the form of a system calculation, in which the player with the highest score is considered worthy of the position. From the system testing carried out the level of compatibility of the system results with the trainer\'s recommendation reached 57.14%.', '9829435 10970877 9541993 9819437 10330381 10213335 10412092 9873068 10108591 10918515 9670816 9682319 10417982 9902511 10059544 11235335 10962168 10279687 10117881 11136394 10832406 10412141 9873303 10114499 11066269 10409571 9849276 9904368 10850080 9924542 10169697 9711840 10668676 10858191 10908568 10792937 10605409 10058400 10838985 10819002 10345118 9538187 9800431 10213332 10412095 9873080 10108935 10927165 10885922 10429996 10359859 10559611 9829419 10970456 9539877 9808859 10065854 9850067 9533545 9777215 10214317 9655396 10135504 11200785 11082168 9707816 9883500 9964490 10440995 9853684 9815396 11010566 10131069 11089843 10527457 10059265 10843314 10927220 10104958 11071776 10388803 10111385 10597771 10648096 10271845 10312431 10155169 11322831 11196359 11060024 9987721 9849962 9530937 9764159