(59, 'PENERAPAN METODE SIMPLE ADDITIVE WEIGHTING (SAW) DALAM PEMBUATAN PERANGKAT LUNAK SISTEM PENDUKUNG KEPUTUSAN UNTUK MENENTUKAN PROGRAM STUDI BAGI SISWA MADRASAH ALIYAH NEGERI (MAN) BANGKALAN', 'The determination of study programs or majors is a very important issue for high school students because it can affect the smooth learning process and the selection of tertiary institutions. In Madrasah Aliyah Negeri (MAN) Bangkalan there are 4 study programs namely: Mathematics and Natural Sciences, Social Sciences, Language, and Religion Study Programs. Currently, the process of determining the study program is still carried out manually by the Guidance Counseling teacher based on the report card grades and students\' interests This results in inaccurate results because judgments are subjective. An assessment based on formal information based on criteria needs to be done to get accurate and objective results. Determination of study programs is assessed based on 4 criteria, namely: students\' academic grades or report cards (the average grade of semester X subjects 1 and 2 related to each study program), the results of majors, knowledge tests (conducted online) , and the results of the psychological test. The four criteria are processed using the Simple Additive Weighting (SAW) method. The results obtained from the system trial using 102 data are 78 data in accordance with current student major data and 24 different data, thus the corresponding data percentage reaches 76.5%.', '9833860 10106897 10094985 10578415 10314065 9805447 10371171 10840342 10842449 11243606 11168904 10141492 10959835 10715267 10217066 9724194 10730460 10449634 9670157 10460271 10895219 11053027 10343370 10701341 10893540 11011067 9742936 10824159 10448353 11209460 11125524 9924599 10169981 10109563 10313555 9792697 10291710 10808990 10685691 11241070 11105462 9824287 10059036 10842154 10898295 9569709 9946516 9888946 9991709 11121491 10685677 10850374 10892605 10206385 9847752 9785749 10660004 103