(60, 'PENERAPAN METODE SITUATED LEARNING DALAM PEMBUATAN APLIKASI VIRTUAL REALITY (Studi Kasus Candi Penataran, Blitar)', 'Panataran Temple is known as one of the oldest Hindu temples in Indonesia has a long history that can be used as a medium of learning. The lack of information that can be obtained in the tourist area of ​​Panataran Temple makes visitors only use their time to take a photo without understanding what is there. Therefore we need an application that can introduce Panataran Temple from history, function, location, and story. The visual integration of temples into the virtual world with the Situated Learning method produces a Virtual Reality application that can simulate the state of the Android-based Panataran Temple. Users can feel the real sensation of exploring Panataran Temple. The Situated Learning method is used as a design for what information is displayed in temple exploration. Situated Learning was chosen because of its effectiveness in building Virtual Reality applications with a percentage of 80.7% which means very good. Panataran Temple Virtual Reality application is also effective for learning the history of Panataran Temple proved by the percentage of User Experince test results of 79.8% which means good and Heuristic testing in general with a percentage value of 80% means very good, and in the Heuristic test specifically by The Office of Youth Culture and Sports Tourism with a percentage of 72% which means good and the application can be used as a medium for promotion of Panataran Temple.', '9688070 9780556 9748932 9739566 10807316 10027290 10683426 10445716 10041184 10405235 9838775 10131492 11100481 10190014 10325182 10083316 11067955 10027385 10683900 10457540 10100301 10320705 9971343 10612365 10093178 10142575 9697365 10596316 10611694 10089841 10214939 10449796 11233455 10915142 11216444 10489866 9871302 9903499 10455105 10597010 10407028 9847748 9785712 10659027 10326490 10116027 9541969 9819329 10327576 10143161 10872165 104766