(61, 'PENERAPAN METODE TREND PROJECTION UNTUK PERAMALAN TINDAKAN KEJAHATAN DI KABUPATEN SUMENEP THE IMPLEMENTATION OF TREND PROJECTION METHOD TO FORCEST CRIMINAL ACTIVITY IN SUMENEP DISTRICT', 'Crimes can occur every day can be in the form of minor and serious crimes. Based on research that has been done, the police so far have only carried out the process of recording criminal reports without any further data processing to obtain useful solutions in handling crime and preventing crime. One of the forecasting methods that can be used to process crime data to produce predictions of crime, so that it can be used by the police for crime prevention facilities. One forecasting method used is the Trend Projection Method. This method of matching trend lines to historical data sets is then projected into the future with a period of time. This method requires data information from previous years so that in this study took data 4 years earlier. With this forecasting method, the results of forecasting the value of a crime are almost close to the actual data even though several periods / months show very large differences. From the results of testing the system imposed on 5 districts for motor vehicle theft, the accuracy value reached 32%, 5 districts for the theft of goods obtained an accuracy value reaching 16%, and 4 districts for animal theft obtained an accuracy value of 6%.', '9928029 10310712 10112220 10618606 9733757 9997021 10863704 9787379 9874500 10144411 10878419 10632959 10586775 10355859 10763771 10850220 9927962 10309101 10071889 9610345 9770576 9889999 9996969 10081107 9840838 9751170 9795471 10305579 10765074 10466109 10143150 9700226 9693762 9797049 10942504 10181371 9891345 10003715 10956189 10624079 9761131 10133894 11160455 10880510 9871403 9903989 10848184 9877109 10323150 10032522 9928343 10318621 10309946 9702461 10621795 10076799 10905004 11165746 11175590 10956180 10623903 9760251 10129478 11050127 10328865 10175415 9854788 9651651 10367735 10823161 10