(62, 'PENERAPAN MVC(MODEL VIEW CONTROLLER) PADA PENGELOLAAN DATA PENGUJIAN KENDARAAN BERMOTOR', 'The requirement for a motorized vehicle to operate in the city of Bangkalan is to pass the KIR test. During this time the KIR Test process is carried out using the KIR Test machine. However, the recording of the results of the KIR Test is still done manually. So it has several weaknesses, including the process of determining whether a vehicle is worthy or not for a long time and has not been computerized. To overcome these problems, an application was made to determine the operational feasibility of motorized vehicles in DISHUB Bangkalan by applying the concept of MVC (Model View Controller). The results of this study indicate that the application of the MVC concept in the vehicle testing data management application is considered to be Good. This can be seen based on the results of the questionnaire calculations that have been carried out from 3 types of respondents, it can be concluded that the average percentage of achievement of the system that is equal to 98.76% declared appropriate and 1.21% stated inappropriate.', '10104921 11071590 10384189 9996021 10057444 10834200 10699461 10919280 10873316 10505400 9901228 10053116 9922317 10158561 9824067 10055481 10762625 10063241 9784853 9856295 9828453 10470497 11336957 9596437 9701045 10104907 9654615 9725390 10713561 9817906 11073341 10444946 10427960 11090271 10138962 11241790 11123561 10305406 9979591 10427949 11090004 10137621 11235095 10956174 10623699 9759234 10124400 10923105 9693757 9797015 10941686 10177281 9870895 9901466 10427917 11089149 10133350 11146901 10422119 9532571 9772329 10189881 10324519 10066705 9871403 9904004 10848246 9878717 10331193 10233645 10138640 11240189 10692906 10444939 11089217 10133682 11155198 10463611 9740049 10809721 9696742 10593195 10778576 11261965 9825551 9674745 10483205 10127649 11004382 10100135 10316510 9866502 10660749 9878754 10331371 10238090 10956175 10623746 9759456 10125