(63, 'PENERAPAN TEKNOLOGI AUGMENTED REALITY SEBAGAI APLIKASI  PEMBELAJARAN INTERAKTIF MEMBACA PADA ANAK USIA DINI DENGAN METODE FONIK', 'Weak reading skills will cause early childhood learning interest to be low. One way to increase learning interest is to use interesting and interactive learning media. However, learning media that are commonly used are more directed towards printed learning media such as books, magazines and posters. The application of Augmented Reality technology was chosen because it can combine the virtual world and the real world in real time. Not only can display objects in two dimensions on paper, but also can display three-dimensional objects and make sounds. This can provide new experiences for young children in learning. Based on the results of user experience testing conducted on students, it is produced that the Fonik Augmented Reality application has an 80% success rate. While the results of testing the user experience of teachers and parents, it is produced that the Fonik Augmented Reality application has a 77% success rate.', '9827530 9684635 10532653 9801382 9553890 9878933 10332273 10260626 10422499 10315728 10563136 10628279 9848225 9788108 10718929 9770766 10182055 10285383 9869552 10285374 10650630 9893885 9847745 9785710 10659056 10326644 10119845 10364966 10809313 10077249 10134985 11187734 10626271 10943952 10318226 9909416 9845374 9773855 9972010 10809310 10077166 10132894 11135470 10077153 10132585 11127806 10119809 10364786 10808410 10054691 9571041 9964677 10445730 9847749 9785721 10659255 10327622 10144316 9858499 9839480 9659510 10144281 9857679 9835381 9557058 9894786 10651505 10679514 10738454 10723636 9888380 10379512 9879100 9942485 9890931 10001630 10945758 10363302 10800999 9869380 10144276 9857562 9834800 9542517 9822063 10786557 10573515 10432276 9583370 9897421 10326841 10124769 10932397 10912097 11084343 10109320 10936717 9761826 10843161 10465915 10142172 9695352 9804988 10359721 10556191 9812306 10152014 1005