(64, 'PENERAPAN WEB SERVICE UNTUK INFORMASI FASILITAS KESEHATAN BERBASIS ANDROID', 'The purpose of this study is to facilitate the public in obtaining information related to health facilities that include locations and routes that are integrated with google maps through the implementation of a Web Service for Android-Based Health Facility Information. The development method in this research is system design that uses web services. This research involves a preliminary study, application development, and validity and reliability field tests to determine the effectiveness of the application of health facilities made. The final result of the research developed is an android-based health facility web service in the form of health facility applications. This health facility application is an application that provides information related to location, route, and general information about health facilities including hospitals, health centers, clinics, and pharmacies located in Sampang Regency. The results of the validity test show the value of r_count> r_tabel = 0.374 which means valid and the reliability test shows that the reliability coefficient (r_11) is 0.826> 0.6 which means reliable. Based on the results of the questionnaire, it can be seen that the application of health facilities that have been developed is able to facilitate the Sampang community in obtaining information on health facilities in Sampang Regency.', '11021745 11091197 10924835 10874296 10139257 11243259 11160233 10098145 9876177 9537251 9795731 10306892 10407358 9793970 10084231 10968128 9750752 10175685 9862905 9854528 9645085 10334902 10326344 10112367 10327576 10143161 10872165 10476671 9805338 10368426 10773755 9969496 9784868 9856759 9830772 9832384 9708900 10653983 10100216 9876185 9537276 9795870 10307580 10424524 10223132 10100135 10316488 9865979 10658117 9812985 10002536 10559665 9695439 9805431 10370851 10834395 11094885 10943291 11082883 10102029 10363826 10803606 9934503 10219501 9785058 