(65, 'Pengaruh Seleksi Fitur Terhadap Performansi Model Klasifikasi Naive Bayes pada Diagnosa Arrhythmia', 'Arrhythmia is a disorder of the heart characterized by abnormal heart rhythm, becoming faster or slower. To diagnose Arrhythmias an Electroardiograph procedure is needed. The results of this Electrocardiograph procedure are Electrodiogram or commonly known as ECG. This ECG is then used as a reference for diagnosing Arrhythmias. ECG data has a large data size so that it requires a proper analysis process. Classification is one approach that can be done to understand the ECG data. One classification algorithm that can handle large amounts of data is Naïve Bayes. The number of features possessed by ECG data becomes its own obstacle in the classification process. Feature selection can be used to reduce features that are less relevant to the dataset. This study aims to determine the effect of feature selection on the performance of the Naive Bayes classification model in arrhythmia diagnoses. The results obtained from this study are the value of accuracy, precision, recall, and f-measure has increased after applying feature selection. This is evidenced by the value of accuracy which increased by 4%, precision increased by 0.13, recall value increased by 0.13, the f-measure value increased by 0.14, and the computational time required is 0.03 seconds faster. The highest performance is obtained in the classification with 80 features. The accuracy is 93%, the precision and recall are 0.45, the f-measure is 0.42, and the computing time is 0.10 seconds.', '9799279 10998222 10459960 11109015 10232686 10114695 9557951 9899244 10433824 10846202 9827611 10075654 10095092 9850574 9799842 11012286 9749031 9742075 9568211 9950530 10091958 10502736 9834704 9720492 9540068 9809819 10767946 10871077 10449486 9669419 10095491 9852571 9809834 11158654 10998207 10459900 11107556 10225394 9932408 9818401 11085721 10116219 11109205 10624247 10933838 10065361 9837826 9618124 10200109 10