(66, 'PENGENALAN PENYAKIT PADA DAUN JAGUNG DENGAN METODE K-NEAREST NEIGHBOUR BERBASIS FITUR GREY LEVEL RUN-LENGTH MATRIX DAN FUZZY COLOR HISTOGRAM', 'Corn is one of the important crops, because corn is the second largest food commodity after rice. However, the demand for corn commodity in Indonesia is still not fulfilled, so it must import from other countries. Among the factors are pests and diseases that attack corn plants which cause low yields of corn. So that digital image processing techniques need to be applied to detect corn plant diseases early. The method that will be used is Fuzzy Color Histogram (FCH) for color extraction because the advantage of this method is that it is not too sensitive to noisy and light differences. As for the texture feature extraction, the method to be used is the Gray Level Run-Length Matrix (GLRLM) method. From the test data of 3,847 corn leaf images, the highest accuracy result from the FCH method was 73.95%, for the GLRLM method it was 69.17%, while for the combination of the two the highest accuracy was 81.29%.', '9910271 10879594 10662402 10343370 10701341 10893509 11010267 9738950 10804224 9950019 10860508 10943262 9910348 10879966 10671716 10389932 9762271 10073055 10130999 11088139 10128304 10630130 9791380 9894516 10644869 10646325 9908721 10481205 11390501 10935042 10144070 9704825 9808731 9981269 9688624 9794389 9909554 10876006 10572630 10644860 10646285 9907736 10476290 11365926 10320705 9971337 10612243 10092567 10127308 9621023 10214591 10443505 10030134 10307032 10410844 9866836 9881154 10343381 10701397 10894966 11046700 9921101 10933745 10844232 10950161 10219666 10082819 9883662 9574661 9982795 10898695 11134200 10777515 10137676 11235352 10962601 9891245 10393822 9846246 9778202 10080652 9829406 10970205 9538637 9802668 9911045 10883466 10759208 10387124 9748241 10850685 11111488 10635665 10990940 11492856 10198769 9978330 10005730 9909495 10875716 10565368 9858195 10127392 10402688 9677192 10289856 9590746 10