(67, 'PENGGUNAAN ATRIBUT GENRE DALAM MODEL NAIVE BAYES UNTUK PROBABILISTIC RANKING DALAM SISTEM REKOMENDASI', 'Recommendation system is a system created with the aim of providing an item recommendation to the user. One model of the recommendation system approach that is often used is Collaborative Filtering (CF), with an item-based approach. This model provides a pretty good recommendation, but the item-based CF does not utilize the item attributes in the calculation of its recommendations. Application of item attributes can be done in two ways, namely with one stage of modeling and two stages of modeling. One stage of modeling results in the quality of recommendations not too significant (not good). The second way is the two stages of modeling, candidate recommendations and the re-ordering stage. For example, the candidate recommendation stage uses a collaborative filtering approach, and re-ordering is done content-based or naïve bayes. In previous studies, the implementation of candidate recommendations using collaborative filtering, and re-ordering with Naive Bayes on data tagging resulted in good recommendations. Therefore in this study the author tries to apply the two stages of candidate ranking modeling with collaborative filtering, and re-ordering using nave bayes. with the case study of movie attribute genre in explicit (2-dimensional) data. From the experimental results get a pretty good value, with an increase in the value of accuracy generated by the NDCG evaluation method by 40.94486%.', '9869300 9893472 10618735 10515661 10000290 9773571 9805470 10371806 10843514 10858310 11322921 11198716 11071806 10046639 10780169 11322834 11196452 11060501 9990106 9909497 9847434 9784157 9838981 9741898 9647095 10344950 10709230 10968135 10922745 10178681 9877889 10327059 10130204 10416756 10028929 10691621 9773575 9805476 10371954 10844256 10862005 11003863 10097554 10642579 10634881 9815139 10013304 10613496 10858292 11322822 11196224 11059356 9984377 9766274 1094