(68, 'PERAMALAN JUMLAH PERMINTAAN BATIK MENGGUNAKAN METODE JARINGAN SARAF TIRUAN ALGORITMA BACKPROPAGATION PADA SISTEM KASIR TOKO BATIK', 'Batik is a craft that is a part of Indonesia\'s cultural heritage and was recognized by UNESCO in 2009. Batik is an attraction for buyers whose number of enthusiasts continues to increase from year to year. So many shops have popped up producing and selling batik products. Of the many shops that exist, not all of them have used a digital system in the ongoing business process. Some batik shops still use the transaction process and sales report entry in a simple way so that it takes up a lot of employee and owner time. In addition, the shop owner cannot estimate the amount of batik supply for the next few days from the results of data entry reports that enter simply. For this reason, it is necessary to have an application that can help in handling business processes in a batik shop and predict the number of batik that will be sold through the forecasting process. The application was built built and designed based on mobile with the implementation of the backpropagation neural network algorithm method. Backpropagation neural network algorithm is used to predict the number of batik that will be sold in the next 1 or 2 days. The results of the implementation of the backpropagation neural network method in predicting the number of batik requests, with the parameters used are learning rate 0.3, max iteration 1000 and max error 0.008363 resulting in an average value of accuracy of 50.94% with the smallest MSE value of 27.2%.', '9616517 9801437 10270992 9900399 9620035 10209660 10710861 9804415 11126620 10320705 9971350 10612487 10093793 10158022 9774599 9990568 10702321 11308700 10840491 9671302 10142541 10087819 10399204 9590133 10060150 10066480 9865836 9876155 10185820 10505495 9903606 10064955 10608538 10073997 9663012 9643301 4857235 4755032 5025257 6376401 9616496 9801344 10268559 9839660 11226540 10820298 9570357 9961281 10360769