(69, 'Perancangan Digital Guide Untuk Wisata Madura Berbasis Location Based Service', 'Madura has a variety of interesting tourist attractions. The number of exotic beaches, as well as other tourist attractions that are not less interesting, makes Madura has a high tourism potential. Unfortunately with a variety of interesting tourist attractions, there are still many people who do not know the location of the tourist sites are located, tourist attractions in Madura also need a promotional container to support the progress of tourism. This study aims to create a Digital Guide application using the concept of Location Based Service (LBS), LBS is used to find out information on a location in accordance with these coordinates so that it can determine the distance of the location from the user\'s location. Augmented Reality technology is used by users using smartphone cameras to find out the location of the tourist destination to be addressed. From the results of research conducted, it was found that the augmented reality feature requires at least 2 attempts to be able to access it using an internet connection. And from the User Experience test results in the form of questionnaires to respondents obtained the results of 1060 out of 1200 scale of maximum value which shows the level of satisfaction is pretty good.', '9593174 10075350 10868746 9812601 9768785 10235931 10164144 11367696 10364966 10809310 10077153 10132641 11129224 10333725 10296941 10939751 10994469 10441192 11030411 9839660 11226540 10820315 9570435 9961667 10370443 10824194 10839850 10450046 9672210 10079899 10201191 10889734 10134596 9657470 9615591 9531072 9764849 10137490 11234441 9570430 9961635 10369681 10805196 10132592 11127936 10327295 10136142 9654167 10104842 10434175 9592853 10073744 10828666 9612197 10170474 10121865 10375059 10939646 10991831 10428015 10701060 10886468 10053012 10812049 10145601 9712496 10671976 9570437 9961661 10370317 10821066 10761676 10058479 10837576 10437985 10002536 10