(70, 'PERBANDINGAN ALGORITMA MAZE GENERATION PADA PERMAINAN ONLINE MAZE SURVIVAL BERBASIS WEBGL DENGAN PENYIMPANAN PADA CLOUD', 'The game is one of the entertainment media that is played by all walks of life from children to adults, especially online games. Online games are a type of game that is much in demand, this is the reason online games continue to be developed. In this research, an online game was developed by implementing the best maze generation algorithm and cloud storage for making maze games. The algorithms being compared are Binary Tree, Aldous-Broder, Hunt-and-Kill, Growing Tree, and Wilson’s. The best choice algorithm is applied to generate maze tracks while cloud storage is used to store player accounts, scores, and result games. In addition, this game is also made using WebGL for creating web-based objects. The maze comparison test results show that the fastest algorithm to create a maze is the Binary Tree algorithm with an average time of 5.13 milliseconds on a 30x30 maze size. In testing storage efficiency, cloud storage is more efficient than local storage, with an average time of 21.20 milliseconds.', '9677269 9901152 10052740 10810685 10111521 10991816 9646689 10342921 10526755 10055747 10825722 10487437 9859181 9842881 9744519 10410443 9864822 9902483 10059395 9688611 10552529 10575249 10475608 10190640 9937689 9844796 9770965 10183047 10290335 9993443 9993020 9591790 10068433 10695835 11146483 10810637 10693919 10500946 10317345 9887415 9686020 10119901 9887451 9686936 10142762 11260794 11382196 10727376 9886989 9675320 9852364 9808796 9981577 9696361 9987811 9852183 9807895 10823026 10755858 9887356 9684566 10083535 9901561 10820876 10366341 10816188 9858492 9839436 10134780 10010796 10600970 10727977 9889999 9996969 10081106 9840808 9751020 9791776 10287108 10317330 9886998 9675563 10010759 10600782 10723316 9866689 9880421 10339715 10683066 10436660 9995903 10054467 10819332 10327658 10145190 9880369 9900451 10011911 10064047 9804943 1035