(71, 'Perbandingan Metode Single Exponential Smoothing dan Backpropagation pada Peramalan Produksi Gula', 'Companies must be able to balance sugar production in accordance with market demand. Because, if sugar production exceeds market demand will cause accumulation and expenditure costs that exceed the limit. However, if the sugar production is too little the company is unable to meet market demand so as to reduce the company\'s opportunity for profit. For this we need a system that can later simplify the process of forecasting sugar production. The system was built using a comparison of 2 methods, namely the Single Exponential Smoothing method and the Backpropagation method. The purpose of this study is to determine the best accuracy results using the Single Exponential Smoothing method and the Backpropagation method in forecasting sugar production. The Single Exponential Smoothing and Backpropagation method is used to predict the amount of sugar production for the next one month based on the production data of the previous 5 months. From the results of tests that have been done, it can be seen that the Backpropagation method produces the smallest MSE and MAPE, amounting to 57187817.49 and MAPE of 1.019593892% compared to the Single Exponential Smoothing method with MSE of 83602989.43 and MAPE of 1.46412926%. So the most appropriate method for forecasting sugar production is the Backpropagation method.', '9894876 10653823 9705543 10217295 10070949 9586845 9653092 9687287 9760982 10133149 11141880 10006392 9797684 10958410 10679665 10039047 9961144 10357394 10497947 9521095 9714949 9902971 10843089 9749699 9686102 9731296 9984705 9774489 10378445 10095450 9808817 9981688 9699049 10055024 10039051 9961349 10362456 10624515 10153934 9708324 9869852 9896236 10028171 10470501 9808709 9981144 9685544 9717418 9524687 9732926 9992860 10759665 10398500 9805112 10362790 10632855 10195641 10751099 10005596 9906131 10468270 11316820 10881076 9874250 9918224 10919346 11237456 