(74, 'RANCANG BANGUN APLIKASI TATA KELOLA DATA PENELITIAN MENGGUNAKAN MODEL UNIFIED PROCESS', 'Management of existing research data in LPPM is still manual. The process of taking the researcher biodata form and depositing the research file is still done manually. Therefore we need an application that can overcome these problems. The application to be developed is the Unified Process model using the Codeigniter Framework. Unified Process is a software development process developed by Ivar Jacobson, Grady Booch, and James Rumbaugh. The results obtained from the construction of this application the entire process of managing research data can be managed easily and quite effectively.', '9680340 9587306 9995855 10053316 10813560 10183403 10445121 11128701 10331102 10231344 10081103 9840747 9750719 9784242 10249445 10622342 10871643 10608327 10463624 9740106 10810004 9703845 10628715 10956191 10624117 9761315 10134810 11183379 10995121 9663220 10081096 9840568 9749820 9761780 10060726 9721862 10328171 9767454 9774870 9606742 10143196 10872345 10481141 9827685 10076035 10885879 10428845 10081097 9840558 9749766 9760417 10026717 10289932 9983323 9740027 10809622 9694343 10581195 10718574 9761826 10843161 10465915 10142186 9695423 9805341 10368569 10777389 10918296 10067449 9890003 10531966 10081814 10956060 10620847 9744972 10031195 10702949 10142175 9695351 9804998 10359938 10561617 9839436 10134780 10010820 10601080 10730740 9903801 10065980 10634549 10204106 10005004 9891345 10003715 10956184 10624005 9760751 10131988 11112806 10642255 10633251 9806985 9972528 9860730 9800181 9938519 10182349 10418694 10077349 10137519 9688627 10185080 10877615 10612855 10956190 10624157 9761526 10135874 11209949 11127971 10718080 10231126 11247591 9753688 9858492 9839444 10134821 10011816 10606067 10842949 10527504 10059496 10844470 10956175 10623748 9759466 10125563 10952242 10010768 10600812 10724101 9870602 9899984 10437531 9767005 10191415 9550928 9864129 9885060 10799078 10636126 1