(75, 'RANCANG BANGUN GAME EDUKASI BAHASA ISYARAT TANGAN ADAPTIF LEVEL', 'The ability to communicate is the main provision in interacting with every human being in everyday life. Starting from verbal language or non-verbal language. One alternative to help increase interest and ability in learning sign language is to use learning media in the form of mobile games. Hand sign language is a language used as a medium for connecting communication between people with disabilities and normal people in general. Existing media still uses learning objectively and no one uses mobile-based digital media. Adaptive level methods are very helpful in sign language recognition. This study aims to measure the level of user experience satisfaction and the level of understanding of hand sign language in application users. Obtaining the user experience measurement results can be obtained the number of success rates of 96% of users satisfied with the hand sign language education game using the adaptive level method so that it is close to perfect results. The results of calculations from a questionnaire study using a Likert scale can be obtained 30 the highest number of scores with the statement that respondents more easily understand the sign language in the form of letters than the introduction of the sign in the form of numbers. Judging from the results of research data the number of game scores from 10 respondents obtained an A score of 20%, a B score of 60% and a C score of 20%.', '9521729 9718131 10309514 10472887 11348920 9895499 10669326 10768606 10622042 10141565 9692310 9789787 9979731 9650220 10360590 10787430 10968511 10932180 10414541 10364144 10666684 10364786 10808410 10054653 9570087 9959919 10326695 10121123 10371341 10456091 9702430 10139481 10128295 11188452 9790045 9887841 10477874 10201986 9994410 10128410 11023383 9804516 11129193 10333562 10292823 10055545 9592382 9680757 10378916 9707190 10258540 9589191 10042943 10761687 10839698 9707177 10258206 9580769 9832372 97