(76, 'RANCANG BANGUN SISTEM KLASIFIKASI JENIS HADIST MENGGUNAKAN ALGORITMA NAIVE BAYES', 'Hadith is a very calculated thing in Islam, because the Hadith is the second source of law after the Qur\'an. However, currently there are many false hadiths circulating which incidentally can lead to understandings that are not in accordance with Islamic teachings. Therefore, this study tries to automate the assessment of the validity of a hadith by implementing the rules contained in ulumul al hadith which are then combined with the naive bayes classification method. This system is expected to be an initial reference in examining the authenticity of a hadith about whether or not it should be used as evidence before finally entering into more in-depth research. And this system also compares the classification results produced by the system with the actual classification results', '9557318 9896064 10417937 10058437 9667301 9664731 9978266 10394775 9786485 9897120 10032590 10190387 10327044 10129842 10414935 10374016 9682684 10036536 9557797 9898474 10429969 10359213 10934054 10852032 9729024 9973342 9881077 11090018 10844876 9693234 9909560 9704155 10630266 9897910 9557725 9898114 10428169 10314293 9811051 10383485 9978403 10398210 9803649 10326225 10109365 10312566 9767868 9822361 10049413 10794041 9695360 10586292 10744070 10399226 9808744 9590710 10063041 10560995 9836325 10119230 11143135 11000880 9691997 9878644 10330831 10224570 9521095 9714949 9902971 10843085 9749683 9686012 9729075 9973599 10414986 10375252 9688859 10190850 9938735 9797130 9532640 9772691 10191697 10333585 10293452 11233002 11243251 11160064 10097292 9854856 11215750 10766365 10472551 9784745 9853684 9815396 11010566 10131073 11089918 10527820 10061075 10852355 11153326 9672984 10184560 9907280 10474016 11354559 10036484 9557532 9897143 10423316 10192921 10339715 10683066 10436660 9995903 10054512 10819543 10332945 10277356 11152515 10454177 10083490 9900401 10791892 9641707 10318019 9904293 10068437 1