(77, 'RESTful WEB SERVICE UNTUK APLIKASI PENERJEMAH BAHASA BILINGUAL MADURA DAN INDONESIA PADA PERANGKAT ANDROID', 'Indonesian web-based Madura bilingual translator application is available at madura.web.id. It is not enough on the web that there is a need for a Madura Indonesian billingual language translator system that can run on all platforms and can be used by other application developers to use this translation system so that learning Madurese can be more developed. One of them is the translator application on Android devices because Android platform is the most widely used by smartphone users. To build a translator system that can be used by all platforms including Android is to create a web service. Web service is a standard and a programming method for sharing data between several applications. The architecture that is very well used is RESTful Web Service because it is lighter and faster. As for the text format used for data exchange, the JSON format is easier to encode or decode by mobile devices. Based on the test results, the response time for Madura and Indonesian bilingual translators on Android devices, the use of web services is faster than the translator system on existing websites, based on the results of testing on 2G networks, the average response time for web services is 31% faster than with websites, on 3G networks 77% faster and on 4G networks 73% faster.', '10320705 9971345 10612446 10093578 10152537 9747175 10845351 9806259 9578267 9610185 9769792 9870467 9899308 9592708 10073020 10810528 9521507 9717007 10303893 10332394 10263570 9714933 10684137 10854116 9739444 10806692 10402347 9824343 10843574 9761826 10843161 10465915 10142184 9695392 9805185 10364699 10680579 10434246 9593203 10075495 10872369 9830696 9830499 9699467 10065417 9839217 9743065 9592900 10073986 10834676 9642245 10612345 10093083 10140220 9685585 9718382 10310757 10503948 10332337 10262203 9680757 10378916 9707196 10258692 9592965 10074308 10137262 10806710 10402845 9826