(78, 'Segmentasi Obyek Dengan Background Dinamis Menggunakan Metode Fuzzy Partitions & Fuzzy Interpolations', 'Image segmentation is the most important stage in\r\nimprove pattern recognition. Until now there has been no method\r\noptimal segmentation for images with dynamic backgrounds.\r\nSegmentation aims to divide the image procedure into\r\nsome of the main constituents of the image. In this research\r\nsegmentation will only divide two parts of the image, i.e.\r\nmain object and background parts. The dataset used in\r\nThis study uses the Fish dataset. Preprocessing is done\r\nfirst with the method of histogram equalization. Algorithm\r\nImage segmentation that will be used in this research is\r\nwith the Fuzzy Partitions and fuzzy partitions methods. Fuzzy Method\r\nPartitions are used for the segmentation process by dividing\r\npartition on the image. Fuzzy Interpolations to improve quality\r\nthe result of segmenting the main object from a background. After\r\nconducted research, segmentation of objects with dynamic background in this study showed an accuracy value of 99.60% using the fuzzy partitions and fuzzy interpolations methods.', '10289858 9590846 10063715 10084316 9921001 10151985 10050290 10798430 9805157 10363969 10662402 10343370 10701341 10893591 11012238 9748791 10853435 11180280 10979634 9585782 9957731 10335648 10344942 10709182 10967901 10916956 10033955 9833921 11083006 10102633 10769605 9865810 9876036 10182809 10430221 10365531 10701386 10538292 10113451 10258784 9985818 10866705 10974251 10294399 9704340 10631191 9805142 10363541 10651700 10289871 9591172 10065344 10092450 10124343 10531034 9686527 10132554 9647256 9564522 9541470 9816825 10265065 10924108 10603346 10048090 10968552 10798422 9804934 10358400 10523143 9647070 10344825 10708601 9903159 10453392 10163541 9802192 9948574 10289856 9590746 10063205 10081767 10955824 10614960 9715535 9905916 10076566 10899211 9964914 10371546 10842214 10899690 10774149 10511481 9979390 9641691 