(81, 'SISTEM INFORMASI MANAJEMEN KEPEGAWAIAN (MARKAS KABUPATEN PMI BANGKALAN)', 'Management Information System is the application of information systems within the Organization to support information - information needed by all levels of management. Management information system is a system that includes the process of collecting, managing, storing up to the process of delivering data and information about staffing in a work unit. Employee data storage is the main thing in staffing issues, especially in finding or changing employee data to then be adjusted to the needs. The application of the Personnel Information System is made by the type of case study research at PMI, where data collection techniques used include observation, interviews, and literature studies. For the analysis and design methods used in making the system using ERD as a data model and DFD as a process model.', '9680340 9587310 9995902 10054469 10819329 10327576 10143161 10872165 10476696 9805470 10371806 10843514 10858292 11322822 11196218 11059320 9984199 9761826 10843161 10465915 10142180 9695385 9805152 10363844 10659242 10858310 11322911 11198448 11070462 10039920 10746580 10852707 9990235 9716911 10501565 9805447 10371221 10840594 10843711 11249910 10935902 10929621 10898219 11127992 10476635 10476651 9805231 10365751 10706883 10565766 9860198 9847966 9786813 9871680 9905384 10135195 10021088 10652416 10451671 9587314 9995945 10055463 10824291 11322921 11198716 11071806 10046639 10780175 11322860 11197103 11063757 10006385 10316495 9866174 10659106 9837621 10125720 10956174 10623763 9759548 10125966 10962261 9889535 10520278 10413999 9882592 9959945 10327338 10137210 9680880 9600816 10113569 10333575 10293153 11231502 10866356 10331371 10238090 10956175 10623738 9759420 10125343 10946694 9811700 9996110 10450245 10084902 10326344 10112367 10476691 9805427 10370662 10829685 10977134 9573281 9975894 10035827 10335502 10341330 10877681 10614557 10677076 10416751 10028756 10690770 10629316 10959