(82, 'SISTEM INFORMASI PEMETAAN PENYEBARAN PENYAKIT DEMAM BERDARAH DENGUE (DBD)', 'Dengue Hemorrhagic Fever (DHF) is an infectious disease that is endemic and often causes extraordinary events (KLB) in Indonesia. In Bangkalan, 2016 the Incidence Rate (IR) was recorded at 84.55 per 100,000 population and the Case Fatality Rate (CFR) was 1.11%. The figure is still above the national target of East Java Province 2016, namely IR? 49 per 100,000 population and CFR <1%. Therefore, we need a system that can provide information related to the mapping of the spread of dengue fever. To help the process of mapping the spread of dengue hemorrhagic fever, a technology is needed by applying the Geographic Information System (GIS) and the K-Means clustering method. This system can help health agencies to evaluate and monitor the spread of dengue fever and as an information medium that makes it easier for the public to know the distribution of dengue fever. Based on the test results using an average questionnaire all statements obtained a value of 4 in the agreed category which means the application of the effective K-Means clustering method was developed to support the performance of the health authorities in knowing the mapping of the spread of dengue in Bangkalan Regency. While the test results in determining the number of clusters using the silhouette coefficient method showed the best results 0.247 on the use of 6 clusters.', '9816521 10020214 10271644 9916774 10029313 10693545 10889699 10914961 10043673 9593466 10076819 9733579 9996122 10136965 10065402 9838779 10032660 10319661 9945350 9883100 9962480 10390801 10938477 10962601 9891231 10393765 9844726 9770614 9890974 10001846 9812491 10000069 10158571 9777344 10214945 11233635 10855772 9747724 10848116 9875398 10314591 9818566 11202320 10136768 10060420 10849085 11071486 10435665 10381551 9720370 10320705 9971333 10612045 10091578 10102582 9497393 9596437 9701045 10104548 9645249 9491235 4859600 4766850 5084351 6281240 1031