(83, 'Sistem Pakar Deteksi Hama dan Penyakit Tanaman Jagung Menggunakan Metode Certainty Factor dan Fuzzy Sugeno', 'Corn is one of the agricultural products in Madura. Most farmers in Madura only rely on rain as irrigation. Corn is a crop that is suitable for agriculture on the island of Madura because the cultivation of corn does not require a lot of irrigation. Besides irrigation, crop failure is one of the factors that affect the stability of the amount of harvest. One of the causes of crop failure is the emergence of pests and diseases. Rapid handling is needed to increase the productivity of maize, but the limited knowledge of farmers and the difficulty of access to experts is also a factor that makes handling slow. Based on the problems faced, an expert system is needed to detect pests and diseases of corn-based plants android. The aim is to make it easier for farmers to know whether corn plants are infected by pests or diseases and how to overcome them. Expert system for pest and disease detection in maize is implemented using Certainty Factor and Fuzzy Sugeno methods that will produce solutions to questions. Based on the research that has been done, it is obtained 85.16% accuracy results and test results based on user questionnaires, on average obtained value 4 in the agreed category which means the questionnaire is effective.', '9909125 10873849 10518793 9625331 10236147 10201217 9990568 10702374 11310005 10847017 9703934 10629161 10958420 10679892 10040185 9989699 11071187 10434157 9592774 10073354 10818844 9563085 9780892 10538542 10114699 11071199 10434221 9593088 10074936 10858442 9761065 10042905 10761514 10835400 9645853 10338737 10422235 10947165 10204674 10007856 9805019 10360499 10575656 9909642 10876450 10583815 9950441 10870983 10995648 11219927 10396613 9525375 9736349 9815668 10201221 9990585 10702808 11320795 10900950 9973609 10415017 10376042 9692824 9899309 9592793 10073456 10821418 9575937 9989176 10667536 10439049 10360514 10575968 9911207