(84, 'SISTEM PAKAR DIAGNOSA PENYAKIT DEMAM BERDARAH DAN DEMAM TYPHOID PADA BALITA METODE DEMSPTER SHAFER', 'Dengue Fever is a disease caused by dengue virus, which enters the human body through the bite of the Aedes aegypti mosquito. Typhus fever is a disease that occurs due to infection of the small intestine and sometimes also occurs in the bloodstream caused by Salmonella Typhil A, B and C. which enter through the digestive tract. Lack of sensitivity of parents to the symptoms of this disease make parents experience their own worries, if health problems occur to toddlers. They are more entrusted to experts, regardless of the disorder is still in a low level or chronic. But with the ease of having experts there are sometimes weaknesses such as limited practice hours and the large number of patients who cause queues. So from this problem came the research to create an expert system to diagnose dengue fever and typhoid fever using the Dempster Shafer method where this method is non monotonous reasoning used to look for inconsistencies due to the addition or reduction of new facts that will change existing rules, so in this study it was concluded that the system\'s accuracy was 93%.', '9816511 10020173 10270569 9889830 9996140 10137051 10067500 9891229 10393742 9844250 9768226 9831250 9703226 9844365 10953507 9845761 9775798 9816595 10020589 10281050 10151865 10437931 11174144 10994904 10052762 10810794 10114195 11058601 10371230 10453328 9688620 9794306 10092611 9737751 10407620 9800461 9549283 9826542 10070326 9571284 9965906 10376520 10976182 10342691 10697941 10911696 11074367 10453562 10949102 11386236 10828466 10392444 10983580 9891241 10393804 9845712 9775549 10014400 9735686 10006660 11104652 10992111 10038779 9954535 10319661 9945315 9882934 9961642 10369823 10808710 10452806 9686020 10510560 10365410 10811526 10132554 11126962 10322424 10014398 9735601 10006241 11094140 10939566 9776069 10599196 10683619 10058819 11231692 10871125 9824476 9669355 9703297 98