(85, 'SISTEM PENDUKUNG KEPUTUSAN DALAM PENENTUAN CENTER MIDFILDER MENGGUNAKAN METODE PROFIL MATCHING PADA SEKOLAH SEPAK BOLA GALING', 'CMF (Center Midfilder) or what is often called a midfielder is a soccer player whose job is to dominate the game in the middle of the field so that opponents are not easy to build attacks. Based on interviews with the Galing Soccer School coach, to become a Midfilder Center requires a number of good abilities in a number of ways, including: passing ability, shooting ability, stamina, control and dribbling. In addition, periodic assessments are also needed to ensure the ability of players. This is often the problem of a trainer because the scoring system is still manual so the data is not stored properly. Based on these problems to help the coach determine the position of the player needed a decision support system for defender recommendations. This system applies the Profile Matching method, so that it can provide recommendations for coaches to be applied to team play. The results of this study indicate that the Profile Matching method has a match level of up to 77%, which is obtained from the matching results of the calculation of the system with the trainer\'s point of view.', '9834181 9917704 9744875 10052600 10809977 10093808 10548926 10166619 9817569 10025442 10283568 9824216 10058680 9670775 9682100 10412490 9875051 9922238 10165926 9814119 10008210 9971529 9835696 10116094 11106143 10608937 9685431 9755381 10105144 10832366 10411928 9872240 10087914 10401610 9650226 9969981 10578262 10313294 9786089 9887225 9681233 10000182 10161426 9791613 9895665 9892292 10008447 9977465 9984115 10858191 10908576 10792977 10605625 10059496 10844453 10955765 9857058 9832265 11270797 9895621 10281734 9778375 9829473 10971800 9546601 9842480 10540630 9610166 9769681 9867713 9885545 10365326 10811124 10122528 11159612 10240945 10189210 10980880 9982636 9678904 10332571 10268085 10608974 9685606 9756266 10109563 10942806 9792252 10289484 10753354