(86, 'SISTEM PENDUKUNG KEPUTUSAN KELAYAKAN KREDIT DENGAN METODE FUZZY TSUKAMOTO PADA BANK UMKM JAWA TIMUR CABANG PAMEKASAN', 'At this time, credit is in great demand by the community because by submitting a request for credit, the community can open a business or develop their business to be more advanced. BPR UMKM Bank itself is engaged in the business credit sector in which the credit lending decision system still uses manual calculations where the risk of non-performing loans is still high. Therefore we need a credit worthiness decision support system at the BPR UMKM Bank to find out how fast the process is carried out by the bank to conduct credit worthiness assessment using this system. In connection with this goal, this study applies Tsukamoto\'s fuzzy logic method. From the test data as much as 50 data that have been done produce an accuracy rate of 90%', '10301130 9872683 9910404 9870077 9897376 10424480 10221989 9847195 9782950 9808731 9981264 9688512 9791580 9895516 10669870 10771342 10690399 10483350 11401241 11203585 11096160 9777778 10460746 11128707 10331136 10232216 10102884 11061396 10129255 11044554 9910381 9869554 9894762 10411420 10669866 10771317 10689790 10480298 11385982 10822105 10751260 10006401 9926340 11049726 10326873 10125563 10952242 9839433 10134782 10010855 10601260 10735245 11049710 10326793 10123545 10901721 9586830 10043623 9684999 9703794 9782994 9852568 10981687 11158545 10604886 10446415 10435303 9598487 9711288 10360930 10007873 9963150 9581480 9850151 9797745 11049734 10326896 10126130 10966445 9910451 9871261 9903291 10454069 10961709 9886771 9980830 10849516 9910416 9870425 9899105 10433135 10438365 10004426 9876875 10321990 10003511 9783290 9817321 10414845 10371806 10843514 10858304 11322867 11197342 11064932 10012268 10463542 9739693 10807939 9652293 9667301 9664735 9978415 10398564 9805425 10370682 10830211 10990312 10420411 10510947 10757971 10746829 10077610 10143998 10876351 10581245 10328215 10159125 10561353 9737569 