(87, 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PEMAIN BOLA VOLI MENGGUNAKAN METODE SMART', 'Improvement of volleyball coaching especially at the regional level is needed to produce the highest score. In an effort to achieve good performance in the sport of volleyball, manual selection of players will take a long time and it is likely that mistakes in judgment can have a negative impact on a team. In the volleyball team there is a coach who chooses the best volleyball player for a team. This task has made it difficult for Club volleyball coach Sampang Regency to choose junior volleyball players (12-14 years). Based on these problems, there needs to be a test and a decision support system so that the coach can easily get talented and appropriate players for volleyball. With the Decision Support System the SMART method can result in the selection of volleyball players. Based on research that has been done, this system makes it easy for coaches to conduct tests on potential volleyball players. The final result of testing using this system has been selected 10 players according to applicable standards. The use of this smart method has an accuracy of up to 70% with the selection of volleyball players manually.', '10344939 10709171 10967840 10915448 9996238 10062841 10861201 11337353 10778168 10531573 10470464 10164931 9592609 9681899 10407485 9850028 9532621 9772583 10191145 10330836 10224672 9914323 10118591 10358698 10530563 9684175 10464356 10134380 10000730 10550637 9860356 9848755 9790767 9891434 10004146 10958334 10677728 10029369 9719220 9924341 10168695 10077356 10137696 11235456 10965137 9903921 10847844 9868652 9890234 9998149 10147100 10891851 10968841 9531808 9768526 10170866 10131637 9932169 10207822 10664969 9965579 10077570 10142971 10871220 10453046 9687219 9759298 10124726 10931298 10906591 11173701 10470474 10164967 9593592 9686807 10530205 10463626 9740113 10810041 9704761 10633285 9973415 9882918 9961562 10367881 10760210 10412151 9873365 10116006 11103909