(88, 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN PEMAIN FUTSAL MENGGUNAKAN METODE SMART', 'Many Futsal Schools make selections for young players who practice futsal at the school. But, the conventional method of skill and physical selection makes this coaching less optimal. One problem that arises is the selection of players who will be included in the competition. Many matches require physical conditions and the capabilities of these players. Then the coach must be accurate in seeing the potential of the players, so that the school can win the match. Based on the above problems, there needs to be a decision support system for the selection of futsal players. Based on the players\' test results, this system gets the basic abilities of players. The best Sisten player has a similarity accuracy of 31.25% with the choice of the coach. This system is expected to make it easier for coaches to determine their best players and optimize their abilities well.', '10246749 11247481 10925016 9703313 10626055 9792642 10291442 10802295 10652201 10446291 9653429 10086410 9973415 9882946 9961716 10371720 10843078 10856127 11311993 10925431 10636394 10213335 10412174 9873467 10118536 11139660 10913971 10819957 9568652 9952751 10147572 9722343 9939955 10626039 9792265 10289568 10755440 10417941 9902310 10839665 10054718 10820574 10358721 10531156 9687130 10538307 10113515 10260398 10026239 10422320 10314830 10558624 10605717 10456080 11011988 10138166 9675304 9704761 10633285 9882892 9961442 10364795 10682981 10446252 9653234 10081475 9850028 9532617 9772576 10191110 10330659 10220193 10866702 10974249 10294378 9703841 10628689 10956042 10620475 9743115 9984745 9775551 10405041 10126636 10979036 9882918 9961562 10367881 10760210 10412135 9873274 10113757 11047651 10316480 9865731 10656889 9782261 9791585 9895541 10670411 10120309 10430201 10364999 10688095 10471839 9781171 9764332 10124564 10927217 10104939 11071691 10386705 10058842 10456064 11011640 10136425 9666605 9661266 9891661 105734