(89, 'SISTEM PENDUKUNG KEPUTUSAN PEMILIHAN RAKET BADMINTON MENGGUNAKAN METODE SIMPLE ADDITIVE WEIGHTING (SAW)', 'In the selection of badminton rackets there are various kinds of racquet specifications. Therefore many people find it difficult to choose badminton rackets that are in accordance with their competencies. To support a good game, many factors need to be considered, one of which is the selection of the racquet that matches the competency of the player. At the same time many racquet manufacturers present quality racket with a variety of specifications. Therefore, decision support is needed to get the racquet as desired. Then the method used for selecting a racquet match is based on user-defined criteria data. That way the process of selecting a racquet will be easier and more accurate. This research is to help the process of selecting racquets with the SAW method so as to obtain accurate recommendations according to the user\'s wishes and provide information to users, especially beginners, about the specifications of the rackets used in the selection of badminton rackets. In conclusion, the SAW method is able to provide badminton racket recommendations with an accuracy of 89%.', '9973415 9882837 9961160 10357775 10507541 9569066 9564190 9930439 10370934 10839152 10823171 10756595 9540515 9812060 10145865 11069167 10424059 10323533 10042136 10819720 9567462 9946786 11062154 10148227 11128174 10719092 9845576 9774860 9997165 9695437 9805411 10370317 10821066 10761640 10058310 10833350 10416855 9896877 10031362 10313165 9782862 9851918 9970504 10008874 9988141 10641701 9793112 10293785 10844034 10860900 9804416 9540459 9811769 10138644 10888572 9521095 9714949 9902971 10843079 9749514 9685182 9708296 9869706 9895515 10669725 10103120 10000567 9780472 10137469 11234336 11249908 10935866 10929430 10897253 11103794 10206571 10633632 9808884 9675916 9867335 9574606 9982515 10891680 10964476 9900619 10797330 10168301 9825988 10067541 9892261 10008285 9882917 9961559