(90, 'Sistem Pendukung Keputusan Pemlihan Anggota TNI Terbaik Dengan Menggunakan Metode Sistem Multi Attribute Rating Technique (SMART)', 'The assessment process of TNI members in Lanal Batuporon is still using the manual method, which is still quite slow and less modern. Therefore, we need the application of a decision support system for the assessment of the best TNI members using the Multi Attribute Rating Technique (SMART) method. By using this method, there are several advantages, namely the weighting of the criteria can be changed so that, if there are additional criteria can add weight according to the level of criteria to be weighted. In addition, the existence of this web-based application has another advantage in assessing without having to wait long because it uses a manual process which is at the time of the ranking process, without having to search for the highest value manually. However, ranking the results of the assessment can directly rank themselves according to the highest final value, and can speed up the process of the manual method.', '9815396 11010566 10131067 11089856 10527504 10059496 10844470 10956191 10624180 9761634 10136396 11223043 11193441 10654819 10305460 9980887 9679072 10114218 11059162 10374051 9682872 9650596 9624956 9843640 11326017 10927070 10885467 10809143 10686449 10463596 9739971 10809334 9687130 10538308 10113526 10260729 10034505 10628869 10956955 10643222 10638097 9831218 10093695 10546092 9761826 10843161 10465915 10142175 9695351 9804979 10359490 10550386 9783290 9817317 10414822 10371221 10840594 10843711 11249920 10936220 10931216 10906181 11171639 11322825 11196301 11059745 9986340 10131071 11089930 10527884 10061396 10853964 9980912 9679706 10117385 11133897 10769996 10656825 10171232 9840651 11251269 10943942 10188576 9927360 11075278 10064006 9803879 10331980 10253263 9847886 9786420 10260334 10415199 11060486 10106546 10476834 9806156 11140255 10538271 10113346 10256156 9920122 10113043 10248545 9729927 9587238 