(91, 'Sistem Pendukung Keputusan Penentuan Pemain Bertahan Menggunakan Metode Profile Matching', 'Defender is a soccer player whose job is to protect the defense area of ​​a team from an opponent\'s attack. Based on the results of interviews with the El Faza Football School coach, to become a defender needed some good skills in various ways, including: the ability to feed (passing), the ability to head (heading), tackling and intercept. In addition, periodic assessments are also needed to ensure the ability of players. This is often the problem of a trainer because the scoring system is still manual so the data is not stored properly. Based on these problems to help the coach determine the position of the player needed a decision support system for defender recommendations. This system applies the Profile Matching method, so that it can provide recommendations to coaches to be applied to team play. The results of this study indicate that the Profile Matching method has a match level of up to 77%, which is obtained from the matching results of the calculation of the system with the trainer\'s point of view.', '9789369 9884460 9969286 10002779 9835696 10116094 11106143 10608937 9685431 9755381 10105144 10832366 10411928 9872252 10088231 10409581 9849511 10966405 10879482 9878290 9938440 9789727 9886249 9978221 10047452 10784251 9841252 9753244 9847392 9783947 9833715 9715551 10687240 10858191 10908572 10792976 10605621 10059452 10844234 10950233 9829387 10969726 9536230 9790639 9610345 9770592 9890456 9999270 10138635 11240166 10692269 11057420 10365326 10811124 10122526 11159613 10240932 10189157 10979512 9975796 9942446 9868578 9605668 10137823 10845480 10868124 9594356 9690641 10562688 10626039 9792252 10289484 10753345 10407451 9849857 9528290 9750925 9884455 9969251 10002606 9831376 10094480 10565751 9860116 9847555 9784765 9854140 10208308 10677105 10026269 10422956 10318020 10574580 10685510 11240149 9910632 11047655 10316510 9866487 10660658 9876458 10319895 9