(92, 'SISTEM PENDUKUNG KEPUTUSAN UNTUK PEMILIHAN OBJEK WISATA DI MADURA MENGGUNAKAN METODE FUZZY', 'Madura is one of the islands located in East Java province which has 4 districts namely Bangkalan, Sampang, Pamekasan, Sumenep. In every regency / region in Madura they have tourism potential that can be visited. But the problem faced is the absence of a system that accommodates the tourism potential in Madura. In addition, tourists have difficulty getting official tourist information about attractions within the scope of Madura. Therefore, we need a decision support system for the selection of attractions in Madura as a way to provide facilities for prospective tourists to be able to choose attractions in Madura that fit the criteria and the number of visitors. In connection with these objectives, this study applies the Fuzzy logic method as a decision support model in the selection of a list of attractions in Madura. Fuzzy is used because this method is a form of decision support model in which the main equipment is a functional hierarchy with the main input criteria that have been determined. So that later the expected results can help facilitate prospective tourists in making decisions to choose attractions in Madura. Based on the results of research conducted to produce 100% accuracy.', '9592933 10074137 10838450 9661115 10415058 10377104 9698117 10031731 10559501 9691250 9784491 9847277 9783378 9819422 11111231 10243773 9812720 9771774 10968346 10927760 10304015 9554194 9099200 6042974 9902486 10450045 11234698 10946170 10199703 9982997 10903643 9596437 9701045 10104922 9654957 9733895 10778953 9708857 10653769 9704212 10184025 9679345 9953067 9764821 9746176 10840367 11233199 10518083 10012391 10076049 10886319 9900446 10011770 10060540 10889142 9914560 10119792 10364699 10680576 10434241 9593197 10075474 10871865 9828184 10939646 10991831 10428015 10701060 10886468 10053020 10812090 10146641 9717681 10697880 10416424 10411253 9891341 10003689 10956047 10620509