(93, 'Sistem Penjadwalan Sales Manajemen Marketing Berbasis Web Framework Laravel Studi Kasus CV. Natusi', 'Natusi is a private company in Mojokerto which is engaged in technology that develops software and applications. In managing the company, it is necessary to need an activity that includes the sale of product sales, product promotion and product marketing. In this case management needs to be done quickly, precisely and systematically so that the development of the Company\'s management increasingly rapidly. One of the developments is to use the laravel framework. Classified as a fairly new framework, Laravel has high security and features that are easily understood by application developers. Based on the results of responses from employees and Admin Natusi CV, Web Management Laravel Framework Based Sales Management Scheduling System shows a very positive response with a total percentage of responses of 90% (the application runs well).', '9844725 11333118 11062926 10392856 10948754 10438264 9785382 9869596 9894964 10656011 9760312 10911036 10667211 10430931 10383303 10119737 11145663 10673430 10007891 9963504 9583249 9894386 10018913 9848483 9789411 10275280 10751501 10585091 10331051 9839450 10134865 10012907 10611526 10870249 10991967 11127971 10718077 10231122 11247468 9753070 9842967 9761826 10843161 10465915 10142190 9695434 9805392 10369822 10808670 10451778 9680864 9600389 10111432 10322882 10025846 9894952 10655661 9751543 10867195 9571201 9965485 10465899 10476257 11365760 10316495 9866172 10659093 9837317 10124199 10918130 9668892 10082286 10958420 10679843 10039941 9983587 10918481 9670630 10125809 10958417 10679856 10040014 9985396 10963661 10810937 10695424 10899106 10368892 10785411 10958414 10679699 10039227 9965671 10470535 9774653 10382542 10115950 10321239 9984695 9689197 9774213 9980939 9680340 9587318 9996140 10060352 10848743 11063042 10170471 9836829 10512375 10765115 10925363 10876936 9853545 9814721 10401845 10046806 10781014 11322826 111