(94, 'Sistem Rekomendasi Dengan Menggunakan Metode K-means Clustering dan Item-Based Collaborative Filtering', 'Recommendation system is a system used to recommend an item, for example recommending a film. The amount of film information on the internet makes it difficult for us to choose a film that suits your taste. For this reason the film\'s recommendation system is needed by the community. This recommendation system requires rating data from movielens. The choice of method greatly influences the success of the system. The more accurate the system made, the better. The most popular method today is collaborative filtering, especially traditional collaborative filtering methods. However, this method has a scalability problem so to overcome this it is necessary to add a clustering method. In previous studies, some have used the method of k-means clustering and user-based collaborative filtering. Collaborative filtering consists of user-based and item-based collaborative filtering. In another study mentioned that the item-based method is more accurate than the user-based collaborative filtering method. For this reason, this research uses k-means clustering and item-based collaborative filtering methods. The results of trials conducted show that the method in this research is more accurate than user-based and item-based collaborative filtering. The percentage increase in the accuracy of the method studied by user-based is 113% whereas when compared with item-based collaborative filtering the increase in accuracy is 168%. The method studied is also more accurate than the combined method of user clustering and user-based collaborative filtering with an increase in accuracy of 27%.', '9869300 9893472 10618735 10515661 10000290 9773571 9805470 10371806 10843514 10858310 11322921 11198716 11071806 10046639 10780184 11322896 11198006 11068264 10028929 10691621 9893480 10618931 10516639 10005184 9895829 10416756 10618903 10516492 10004440 9877274 10323967 10052956 10030522 1