(95, 'SISTEM REKOMENDASI KENAIKAN JENJANG JABATAN PADA JABATAN FUNGSIONAL PENGAWAS INSPEKTORAT KABUPATEN BANGKALAN MENGGUNAKAN METODE AHP', 'Employees are a very important asset in an organization. In order to reward and motivate existing employees, a system of promotion recommendations was made for the Bangkalan District Inspectorate Office\'s Functional Supervisory Office. This system is made using AHP (Analytical Hierarchy Process) calculation method. AHP produces a ranking obtained by comparing each criterion and also alternatives in this case prospective candidates who will be given a promotion. AHP is a method of making pairwise comparisons between selection criteria and also pairwise comparisons between available choices. The problem of decision making with AHP is generally compiled into criteria, and alternative choices. The results of the implementation of the AHP method in providing recommendations for incremental ranks, after 4 times the recommendation test was conducted, the average accuracy of 86.25% was obtained. Thus the implementation of the AHP method in the promotion recommendation shows that the recommendation results are \"good\".', '10028756 10690770 10629259 10958907 9910844 10101211 10343370 10701341 10893500 11010051 9737871 10798841 9815448 11011795 10137205 10852707 9990235 9716911 10501561 9805320 10367994 10763021 10846474 9834324 10109220 10934281 10140271 9757418 9951676 10695981 10901881 10438355 9787691 9927285 10183403 10445064 11127268 10323951 10052606 10629321 10959220 9918681 10140389 11248932 11322899 11198139 11068931 10032271 10708335 10963661 10810939 10695421 10899079 10368264 10769746 9869300 9893472 10618735 10515661 10000290 9773559 9805392 10369776 10807487 10422203 9532997 9774457 9596437 9701045 10104855 9653316 9692950 9902486 10450035 11234660 10945312 10195411 9961529 10367041 10819694 10727326 9886731 9980641 10844762 9791549 10023720 9968627 9999495 9753611 10096285 10220290 10585968 9961205 10358947 10536794 9715