(96, 'SISTEM REKOMENDASI MENU MAKANAN MENGGUNAKAN SVD (SINGULAR VALUE DECOMPOSITION) PADA APLIKASI RESTORAN', 'The menu is a list of foods that have been equipped with their respective prices, which are provided and displayed to attract customers and provide value to the food offered. Food menu reservations sometimes experience problems with the lack of service in the ordering process due to crowded restaurant conditions. In addition there are more problems faced by customers when sometimes lazy to see a list of menus that are too many so that customers only order menus that are normally customers ordered and it is difficult for employees to record menu orders from customers when there are many customer orders due to crowded restaurant conditions. Therefore a restaurant system is needed that can handle problems related to the ordering process and also recommendations for selecting food menus. The results of the implementation of the Singular Value Decomposition method for food menu recommendations, produce an accuracy value with the F1-Score calculation results of 16.66% based on data testing with a reduction performed as much as ¼ from each matrix.', '10059182 10842896 10526180 10443515 11088493 10130082 10674562 10013547 10104905 11071514 10382220 10728036 9890279 9998386 10116543 10726692 9883574 9964850 10449971 10078087 10937231 10155023 9759595 10126200 10968105 10921980 10159562 9782293 9792306 9899131 10433255 10831976 10409996 9862594 9846684 9780411 9839654 11226425 10819741 9567566 9947314 10011594 11228037 11218424 10779731 10539398 10118970 11141825 10968107 10922091 10162261 9795782 9916512 10129536 10660946 9945455 9965121 9981966 10066180 9858271 9838340 10129317 10655471 9918095 10062369 10858838 10924676 10092235 10119040 11142190 9805375 10369411 10798450 10196240 10765971 10079967 10202981 9999378 9750716 10081814 10956060 10620887 9745159 10035875 10726351 10346963 9547420 9846574 10561096 10121819 11156070 10152369 9746325 10059860 10846278 982