(97, 'Sistem Rekomendasi Pemilihan Tempat Kost Menggunakan Metode Simple Additive weighting (SAW) Berbasis Web', 'The ease in obtaining information about boarding places is still considered difficult by migrants such as students and students who need temporary shelter. Until now there is no system that is able to provide boarding house recommendations in accordance with what is sought by boarders. Some criteria can be an option to determine boarding places. These criteria include price, location, facilities and payment period. The method used in this study is Simple Additive Weighting (SAW) as a weighting method. The system is also integrated with Google Maps to display boarding locations. The recommendation system for the boarding house selection was built with the PHP and MySQL web-based programming languages ​​as the database. Input from this system in the form of choice criteria. While the results of this recommendation system are able to provide recommendations for the choice of boarding houses sorted by highest weight in the SAW method. In functional testing the results obtained by 100%, which proves that the system runs well according to design. And for testing the accuracy obtained by 70%. So it can be concluded that the Simple Additive Weighting (SAW) method can be used to recommend a boarding house in the area of ​​Telang Kamal Bangkalan', '9775740 10019155 9854528 9645085 10334902 10326344 10112367 10327576 10143161 10872165 10476601 9804977 10359470 10549885 9780778 9754493 9878534 10330271 10210574 10343140 9528315 9751055 10083500 9900619 10797330 10168230 9825627 10065737 9847174 9782862 9851918 9970514 10008925 9989379 10672570 10564945 10246715 10218066 9749210 10855526 11232566 11241070 11105566 9824822 10061710 11105556 9824764 10061432 10854146 11198067 11068574 10030491 10699445 10846121 9825556 11237256 11010210 10129296 10021595 10654966 10124764 11170807 11322899 11198148 11068970 10032450 10709226 10968103 10921977 10159470 9781830 9754456 9